export const data = {

    "S1S1_1": "\u0393\u03b5\u03b9\u03b1 \u03c3\u03bf\u03c5 \u03c6\u03af\u03bb\u03b5 \u03bc\u03bf\u03c5!",
    "S1S1_2": "\u0393\u03b5\u03b9\u03b1!",
    "S1S1_3": "\u0395\u03af\u03bc\u03b1\u03b9 \u03bf \u03b1\u03b3\u03b3\u03b5\u03bb\u03b9\u03b1\u03c6\u03cc\u03c1\u03bf\u03c2 \u03c4\u03bf\u03c5 \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac. \u0388\u03c7\u03bf\u03c5\u03bc\u03b5 \u03bc\u03b9\u03b1 \u03b1\u03c0\u03bf\u03c3\u03c4\u03bf\u03bb\u03ae \u03b3\u03b9\u03b1 \u03b5\u03c3\u03ad\u03bd\u03b1! \u039f \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ad\u03c7\u03b5\u03b9 \u03b1\u03ba\u03bf\u03cd\u03c3\u03b5\u03b9 \u03cc\u03c4\u03b9 \u03b5\u03af\u03c3\u03b1\u03b9 \u03bf \u03ba\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03bf\u03c2 \u03c4\u03b5\u03c7\u03bd\u03af\u03c4\u03b7\u03c2 \u03c4\u03bf\u03c5 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b5\u03af\u03bf\u03c5 \u03ba\u03b1\u03b9 \u03cc\u03c4\u03b9 \u03b2\u03c1\u03af\u03c3\u03ba\u03b5\u03b9\u03c2 \u03bb\u03cd\u03c3\u03b5\u03b9\u03c2 \u03c3\u03b5 \u03ba\u03ac\u03b8\u03b5 \u03b5\u03af\u03b4\u03bf\u03c5\u03c2 \u03c0\u03c1\u03cc\u03b2\u03bb\u03b7\u03bc\u03b1. \u0395\u03af\u03bd\u03b1\u03b9 \u03b1\u03bb\u03ae\u03b8\u03b5\u03b9\u03b1 \u03b1\u03c5\u03c4\u03cc;",
    "S1S1_4": "\u039b\u03bf\u03b9\u03c0\u03cc\u03bd, \u03ba\u03ac\u03bd\u03c9 \u03cc\u03c4\u03b9 \u03ba\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03bf \u03bc\u03c0\u03bf\u03c1\u03ce!",
    "S1S1_5": "\u039c\u03b7\u03bd \u03b5\u03af\u03c3\u03b1\u03b9 \u03c4\u03cc\u03c3\u03bf \u03c4\u03b1\u03c0\u03b5\u03b9\u03bd\u03cc\u03c2. \u0395\u03ac\u03bd \u03b1\u03c5\u03c4\u03cc \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03bb\u03ae\u03b8\u03b5\u03b9\u03b1 \u03c4\u03cc\u03c4\u03b5 \u03c0\u03ac\u03c1\u03b5 \u03c4\u03b1 \u03c0\u03c1\u03ac\u03b3\u03bc\u03b1\u03c4\u03ac \u03c3\u03bf\u03c5 \u03ba\u03b1\u03b9 \u03ad\u03bb\u03b1 \u03bc\u03b1\u03b6\u03af \u03bc\u03bf\u03c5 \u03c3\u03c4\u03b7 \u03c0\u03c1\u03c9\u03c4\u03b5\u03cd\u03bf\u03c5\u03c3\u03b1 \u03c4\u03b7\u03c2 Lalandia, \u03c4\u03b7\u03bd \u0395\u03bd\u03c3\u03c5\u03bd\u03b1\u03af\u03c3\u03b8\u03b7\u03c3\u03b7!",
    "S1S2_1": "\u0391\u03b1\u03b1! \u03b5\u03af\u03bc\u03b1\u03b9 \u03c7\u03b1\u03c1\u03bf\u03cd\u03bc\u03b5\u03bd\u03bf\u03c2 \u03c0\u03bf\u03c5 \u03b1\u03c0\u03bf\u03b4\u03ad\u03c7\u03c4\u03b7\u03ba\u03b5\u03c2 \u03c4\u03b7\u03bd \u03c0\u03c1\u03cc\u03c3\u03ba\u03bb\u03b7\u03c3\u03ae \u03bc\u03bf\u03c5. \u0395\u03af\u03bc\u03b1\u03b9 \u03bf \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03c4\u03b7\u03c2 Lalandia. \u03a7\u03c1\u03b5\u03b9\u03ac\u03b6\u03bf\u03bc\u03b1\u03b9 \u03bc\u03b9\u03b1 \u03bd\u03ad\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03ad\u03c8\u03c9 \u03c3\u03b5 \u03cc\u03bb\u03bf \u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf. \u039c\u03bf\u03c5 \u03ad\u03c7\u03bf\u03c5\u03bd \u03c0\u03b5\u03b9 \u03cc\u03c4\u03b9 \u03b5\u03af\u03c3\u03b1\u03b9 \u03bf \u03ba\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03bf\u03c2 \u03c4\u03b5\u03c7\u03bd\u03af\u03c4\u03b7\u03c2\/\u03c3\u03c7\u03b5\u03b4\u03b9\u03b1\u03c3\u03c4\u03ae\u03c2 \u03c3\u03b5 \u03cc\u03bb\u03bf \u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf. \u0388\u03c4\u03c3\u03b9 \u03b7 \u03b1\u03c0\u03bf\u03c3\u03c4\u03bf\u03bb\u03ae \u03bc\u03bf\u03c5, \u03b5\u03c6\u03cc\u03c3\u03bf\u03bd \u03c4\u03b7\u03bd \u03b4\u03b5\u03c7\u03c4\u03b5\u03af\u03c2, \u03b5\u03af\u03bd\u03b1\u03b9 \u03bd\u03b1 \u03c6\u03c4\u03b9\u03ac\u03be\u03b5\u03b9\u03c2 \u03b3\u03b9\u03b1 \u03b5\u03bc\u03ad\u03bd\u03b1 \u03c4\u03b7\u03bd \u03ba\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b7 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c3\u03c4\u03bf\u03bd \u03ba\u03cc\u03c3\u03bc\u03bf.",
    "S1S2_2": "\u039a\u03b1\u03b9 \u03b5\u03b3\u03ce \u03b5\u03af\u03bc\u03b1\u03b9 \u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03c4\u03b7\u03c2 Lalandia. \u0398\u03b1 \u03c7\u03c1\u03b7\u03c3\u03b9\u03bc\u03bf\u03c0\u03bf\u03b9\u03ae\u03c3\u03c9 \u03ba\u03b1\u03b9 \u03b5\u03b3\u03ce \u03c4\u03b7\u03bd \u03bd\u03ad\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03b3\u03c5\u03c1\u03af\u03c3\u03c9 \u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf. \u03a7\u03c1\u03b5\u03b9\u03ac\u03b6\u03bf\u03bc\u03b1\u03b9 \u03bc\u03af\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c0\u03bf\u03c5 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03c1\u03b1\u03ba\u03c4\u03b9\u03ba\u03ae \u03b1\u03bb\u03bb\u03ac \u03ba\u03b1\u03b9 \u03b7 \u03bf\u03bc\u03bf\u03c1\u03c6\u03cc\u03c4\u03b5\u03c1\u03b7 \u03c3\u03c4\u03bf\u03bd \u03ba\u03cc\u03c3\u03bc\u03bf.",
    "S1S2_3": "\u039d\u03b1\u03b9, \u03bd\u03b1\u03b9. \u03a7\u03c1\u03b5\u03b9\u03ac\u03b6\u03b5\u03c4\u03b1\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03cc\u03bb\u03b1 \u03b1\u03c5\u03c4\u03ac. \u039a\u03b1\u03b9 \u03c4\u03b7 \u03c7\u03c1\u03b5\u03b9\u03b1\u03b6\u03cc\u03bc\u03b1\u03c3\u03c4\u03b5 \u03bc\u03ad\u03c3\u03b1 \u03c3\u03b5 6 \u03bc\u03ae\u03bd\u03b5\u03c2. \u0398\u03b1 \u03c0\u03ac\u03bc\u03b5 \u03c3\u03c4\u03bf \u0391\u03bd\u03ce\u03c4\u03b1\u03c4\u03bf \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03cc \u03a3\u03c5\u03bc\u03b2\u03bf\u03cd\u03bb\u03b9\u03bf \u03cc\u03c0\u03bf\u03c5 \u03b8\u03b1 \u03c3\u03c5\u03bd\u03b1\u03bd\u03c4\u03b7\u03b8\u03bf\u03cd\u03bd \u03cc\u03bb\u03bf\u03b9 \u03bf\u03b9 \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03b4\u03b5\u03c2 \u03c4\u03bf\u03c5 \u0392\u03bf\u03c1\u03c1\u03ac. \u03a4\u03ce\u03c1\u03b1, \u03b4\u03ad\u03c7\u03b5\u03c3\u03b1\u03b9;",
    "S1S2_4": "\u0392\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03ac \u03bc\u03bf\u03c5, \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03bc\u03bf\u03c5, \u03b8\u03b1 \u03ae\u03c4\u03b1\u03bd \u03c4\u03b9\u03bc\u03ae \u03bc\u03bf\u03c5 \u03bd\u03b1 \u03b4\u03b5\u03c7\u03c4\u03ce \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03b5\u03bd\u03b4\u03b9\u03b1\u03c6\u03ad\u03c1\u03bf\u03c5\u03c3\u03b1 \u03b1\u03c0\u03bf\u03c3\u03c4\u03bf\u03bb\u03ae. \u0395\u03c0\u03bf\u03bc\u03ad\u03bd\u03c9\u03c2 \u03c4\u03b7 \u03b4\u03ad\u03c7\u03bf\u03bc\u03b1\u03b9. \u03a0\u03c1\u03bf\u03ba\u03b5\u03b9\u03bc\u03ad\u03bd\u03bf\u03c5, \u03cc\u03bc\u03c9\u03c2, \u03bd\u03b1 \u03c3\u03c7\u03b5\u03b4\u03b9\u03ac\u03c3\u03c9 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03ad\u03c7\u03c9 \u03c0\u03bf\u03bb\u03bb\u03ad\u03c2 \u03b5\u03c1\u03c9\u03c4\u03ae\u03c3\u03b5\u03b9\u03c2 \u03bd\u03b1 \u03c3\u03b1\u03c2 \u03ba\u03ac\u03bd\u03c9 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03ba\u03b1\u03c4\u03b1\u03bb\u03ac\u03b2\u03c9 \u03c4\u03b9 \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03b5\u03c3\u03c4\u03b5.",
    "S1S2_5": "\u03a4\u03b9\u03c2 \u03be\u03ad\u03c1\u03b5\u03b9\u03c2 \u03cc\u03bb\u03b5\u03c2 \u03c4\u03b9\u03c2 \u03b1\u03c0\u03b1\u03bd\u03c4\u03ae\u03c3\u03b5\u03b9\u03c2! \u039c\u03cc\u03bb\u03b9\u03c2 \u03c3\u03c4\u03b9\u03c2 \u03b5\u03af\u03c0\u03b1\u03bc\u03b5. \u03a4\u03ce\u03c1\u03b1 \u03c0\u03ae\u03b3\u03b1\u03b9\u03bd\u03b5! \u0397 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03ba\u03b1\u03b9 \u03b5\u03b3\u03ce \u03c6\u03b9\u03bb\u03bf\u03be\u03b5\u03bd\u03bf\u03cd\u03bc\u03b5 \u03c4\u03bf\u03bd \u03c0\u03c1\u03af\u03b3\u03ba\u03b9\u03c0\u03b1 \u03c4\u03b7\u03c2 \u039d\u03cc\u03c4\u03b9\u03b1\u03c2 \u0398\u03ac\u03bb\u03b1\u03c3\u03c3\u03b1\u03c2 \u03ba\u03b1\u03b9 \u03b4\u03b5\u03bd \u03ad\u03c7\u03bf\u03c5\u03bc\u03b5 \u03c7\u03c1\u03cc\u03bd\u03bf \u03bd\u03b1 \u03c4\u03bf \u03c3\u03c5\u03b6\u03b7\u03c4\u03ae\u03c3\u03bf\u03c5\u03bc\u03b5 \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03bf. \u039a\u03b1\u03bb\u03ae \u03c4\u03cd\u03c7\u03b7!",
    "S1S2_6": "\u0391\u03bb\u03bb\u03ac \u03c4\u03b9 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b8\u03b1 \u03c3\u03c7\u03b5\u03b4\u03b9\u03ac\u03c3\u03c9; \u03a0\u03bf\u03b9\u03b5\u03c2 \u03b8\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03bf\u03b9 \u03b4\u03b9\u03ac\u03c6\u03bf\u03c1\u03b5\u03c2 \u03bb\u03b5\u03b9\u03c4\u03bf\u03c5\u03c1\u03b3\u03af\u03b5\u03c2 \u03c4\u03b7\u03c2; \u0394\u03b5\u03bd \u03ad\u03c7\u03c9 \u03ba\u03b1\u03bd\u03ad\u03bd\u03b1 \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03bf \u03b3\u03b9\u03b1 \u03c4\u03bf \u03c4\u03b9 \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03b5\u03c4\u03b1\u03b9 \u03bf \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1. \u038c\u03bb\u03bf \u03b1\u03c5\u03c4\u03cc \u03b5\u03af\u03bd\u03b1\u03b9 \u03c4\u03cc\u03c3\u03bf \u03b8\u03bf\u03bb\u03cc.",
    "S1S3_1": "\u03a0\u03bf\u03b9\u03b1 \u03b1\u03ba\u03c1\u03b9\u03b2\u03ce\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03ba\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b7, \u03c0\u03b9\u03bf \u03c0\u03c1\u03b1\u03ba\u03c4\u03b9\u03ba\u03ae, \u03c0\u03b9\u03bf \u03cc\u03bc\u03bf\u03c1\u03c6\u03b7 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c4\u03bf\u03c5 \u03ba\u03cc\u03c3\u03bc\u03bf\u03c5; \u0398\u03b1 \u03b5\u03b9\u03c3\u03ad\u03bb\u03b8\u03b5\u03b9\u03c2 \u03c3\u03b5 \u03ad\u03bd\u03b1\u03bd \u03ba\u03cc\u03c3\u03bc\u03bf \u03b3\u03b5\u03bc\u03ac\u03c4\u03bf \u03c7\u03b1\u03c1\u03b1\u03ba\u03c4\u03ae\u03c1\u03b5\u03c2 \u03cc\u03c0\u03bf\u03c5 \u03b8\u03b1 \u03c3\u03bf\u03c5 \u03c0\u03bf\u03c5\u03bd \u03b4\u03b9\u03b1\u03c6\u03bf\u03c1\u03b5\u03c4\u03b9\u03ba\u03ad\u03c2 \u03b1\u03c0\u03cc\u03c8\u03b5\u03b9\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03bf \u03c0\u03ce\u03c2 \u03bd\u03bf\u03bc\u03af\u03b6\u03bf\u03c5\u03bd \u03cc\u03c4\u03b9 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c5\u03c4\u03ae \u03b7 \u03ac\u03bc\u03b1\u03be\u03b1.",
    "S1S3_2": "\u03a6\u03b1\u03af\u03bd\u03b5\u03c3\u03b1\u03b9 \u03c7\u03b1\u03bc\u03ad\u03bd\u03bf\u03c2\/\u03b7!",
    "S1S3_3": "\u039b\u03bf\u03b9\u03c0\u03cc\u03bd, \u03b5\u03af\u03bc\u03b1\u03b9 \u03bb\u03af\u03b3\u03bf. \u039f \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03bc\u03cc\u03bb\u03b9\u03c2 \u03bc\u03bf\u03c5 \u03ad\u03b4\u03c9\u03c3\u03b1\u03bd \u03c4\u03b7\u03bd \u03b1\u03c0\u03bf\u03c3\u03c4\u03bf\u03bb\u03ae \u03bd\u03b1 \u03c6\u03c4\u03b9\u03ac\u03be\u03c9 \u03bc\u03af\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b3\u03b9\u03b1 \u03b1\u03c5\u03c4\u03bf\u03cd\u03c2. \u0391\u03bb\u03bb\u03ac \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03bf\u03bc\u03b1\u03b9 \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b5\u03c2 \u03c0\u03bb\u03b7\u03c1\u03bf\u03c6\u03bf\u03c1\u03af\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c4\u03b7 \u03c3\u03c7\u03b5\u03b4\u03b9\u03ac\u03c3\u03c9 \u03ba\u03b1\u03c4\u03ac\u03bb\u03bb\u03b7\u03bb\u03b1. \u0393\u03b9\u03b1 \u03c0\u03bf\u03b9\u03bf\u03bd \u03bb\u03cc\u03b3\u03bf \u03c4\u03b7 \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03bf\u03bd\u03c4\u03b1\u03b9; \u03a4\u03b9 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03ba\u03ac\u03bd\u03b5\u03b9; \u03a3\u03b5 \u03c4\u03b9 \u03b5\u03af\u03b4\u03bf\u03c5\u03c2 \u03b4\u03c1\u03cc\u03bc\u03bf\u03c5\u03c2 \u03c4\u03b1\u03be\u03b9\u03b4\u03b5\u03cd\u03bf\u03c5\u03bd \u03c3\u03c5\u03bd\u03ae\u03b8\u03c9\u03c2; \u03c0\u03cc\u03c3\u03bf \u03bc\u03b5\u03b3\u03ac\u03bb\u03b7 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9; \u03c0\u03bf\u03b9\u03b5\u03c2 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03bb\u03b5\u03b9\u03c4\u03bf\u03c5\u03c1\u03b3\u03af\u03b5\u03c2 \u03c4\u03b7\u03c2; \u03cc\u03bb\u03b1 \u03b1\u03c5\u03c4\u03ac \u03c0\u03b1\u03c1\u03ad\u03bc\u03b5\u03b9\u03bd\u03b1\u03bd \u03b8\u03bf\u03bb\u03ac \u03bc\u03b5 \u03c4\u03b7\u03bd \u03c0\u03b1\u03c1\u03b1\u03b3\u03b3\u03b5\u03bb\u03af\u03b1 \u03c4\u03bf\u03c5\u03c2.",
    "S1S3_4": "\u03a6\u03af\u03bb\u03b5 \u03bc\u03bf\u03c5, \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c6\u03c4\u03b9\u03ac\u03be\u03b5\u03b9\u03c2 \u03bc\u03b9\u03b1 \u03b4\u03c5\u03bd\u03b1\u03c4\u03ae \u03ba\u03b1\u03b9 \u03bc\u03b5 \u03bc\u03b5\u03b3\u03ac\u03bb\u03b7 \u03b1\u03bd\u03c4\u03bf\u03c7\u03ae \u03ac\u03bc\u03b1\u03be\u03b1! \u0398\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c3\u03c6\u03b1\u03bb\u03ae\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03ad\u03c8\u03b5\u03b9 \u03bc\u03b5 \u03b1\u03c5\u03c4\u03ae\u03bd \u03b7 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03ae \u03bf\u03b9\u03ba\u03bf\u03b3\u03ad\u03bd\u03b5\u03b9\u03b1. \u039a\u03b1\u03b9 \u03b4\u03b5\u03bd \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03b5\u03c4\u03b1\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c6\u03b1\u03bd\u03c4\u03b1\u03c7\u03c4\u03b5\u03c1\u03ae, \u03c5\u03c0\u03ac\u03c1\u03c7\u03b5\u03b9 \u03bf\u03bc\u03bf\u03c1\u03c6\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c3\u03c4\u03bf \u03ac\u03b3\u03c1\u03b9\u03bf. \u0391\u03bb\u03bb\u03ac \u03bc\u03ac\u03bb\u03bb\u03bf\u03bd \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03c0\u03b5\u03c1\u03b9\u03b7\u03b3\u03b7\u03b8\u03b5\u03af\u03c2 \u03ba\u03b1\u03b9 \u03b1\u03bb\u03bb\u03bf\u03cd \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c3\u03c5\u03b3\u03ba\u03b5\u03bd\u03c4\u03c1\u03ce\u03c3\u03b5\u03b9\u03c2 \u03ba\u03b1\u03b9 \u03ac\u03bb\u03bb\u03b5\u03c2 \u03b3\u03bd\u03ce\u03bc\u03b5\u03c2.",
    "S1S4_1": "\u03a4\u03b1 \u03bc\u03b1\u03ba\u03c1\u03b9\u03bd\u03ac \u03c4\u03b1\u03be\u03af\u03b4\u03b9\u03b1 \u03bc\u03c0\u03bf\u03c1\u03b5\u03af \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03be\u03b1\u03bd\u03c4\u03bb\u03b7\u03c4\u03b9\u03ba\u03ac. \u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03ac\u03bd\u03b5\u03c4\u03b7. \u039a\u03b1\u03b9 \u03b4\u03b5\u03bd \u03c4\u03bf \u03bb\u03ad\u03c9 \u03bc\u03cc\u03bd\u03bf \u03b3\u03b9\u03b1 \u03b5\u03bc\u03ad\u03bd\u03b1 \u03b1\u03bb\u03bb\u03ac \u03b5\u03c0\u03af\u03c3\u03b7\u03c2 \u03ba\u03b1\u03b9 \u03b3\u03b9\u03b1 \u03c4\u03bf \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03cc \u03b6\u03b5\u03cd\u03b3\u03bf\u03c2!",
    "S1S4_2": "\u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03c0\u03bb\u03bf\u03c5\u03c3\u03b9\u03cc\u03c4\u03b5\u03c1\u03b7 \u03c0\u03bf\u03c5 \u03ad\u03c7\u03b5\u03b9 \u03c6\u03c4\u03b9\u03b1\u03c7\u03c4\u03b5\u03af \u03c0\u03bf\u03c4\u03ad \u03c3\u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf, \u03c0\u03c1\u03bf\u03ba\u03b5\u03b9\u03bc\u03ad\u03bd\u03bf\u03c5 \u03bd\u03b1 \u03b4\u03b5\u03af\u03c7\u03bd\u03b5\u03b9 \u03c4\u03b7\u03bd \u03b4\u03cd\u03bd\u03b1\u03bc\u03b7 \u03c4\u03bf\u03c5 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c4\u03bf\u03bd \u03c0\u03bb\u03bf\u03cd\u03c4\u03bf \u03b1\u03c5\u03c4\u03ae\u03c2 \u03c4\u03b7\u03c2 \u03b3\u03b7\u03c2, \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03bd\u03b1 \u03ad\u03c1\u03b3\u03bf \u03c4\u03ad\u03c7\u03bd\u03b7\u03c2 \u03ba\u03b1\u03b9 \u03c0\u03bf\u03bb\u03c5\u03c4\u03ad\u03bb\u03b5\u03b9\u03b1\u03c2!",
    "S1S4_3": "\u0397 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03ae \u03bf\u03b9\u03ba\u03bf\u03b3\u03ad\u03bd\u03b5\u03b9\u03b1 \u03ad\u03c7\u03b5\u03b9 \u03bd\u03b1 \u03ba\u03bf\u03c5\u03b2\u03b1\u03bb\u03ae\u03c3\u03b5\u03b9 \u03bc\u03b1\u03b6\u03af \u03c4\u03b7\u03c2 \u03c0\u03bf\u03bb\u03bb\u03ac \u03c0\u03c1\u03ac\u03b3\u03bc\u03b1\u03c4\u03b1, \u03cc\u03c0\u03c9\u03c2 \u03c1\u03bf\u03cd\u03c7\u03b1, \u03b4\u03ce\u03c1\u03b1 \u03ba.\u03b1. \u0388\u03c4\u03c3\u03b9 \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03bf\u03bc\u03b1\u03b9 \u03c7\u03ce\u03c1\u03bf \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c4\u03b1 \u03b2\u03ac\u03bb\u03c9 \u03c3\u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1.",
    "S1S4_4": "\u03a3\u03ba\u03ad\u03c8\u03bf\u03c5 \u03c4\u03b1 \u03ac\u03bb\u03bf\u03b3\u03b1 \u03c0\u03bf\u03c5 \u03b8\u03b1 \u03c3\u03ad\u03c1\u03bd\u03bf\u03c5\u03bd \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1. \u0391\u03bd \u03b8\u03ad\u03bb\u03b5\u03b9\u03c2 \u03bd\u03b1 \u03c0\u03b7\u03b3\u03b1\u03af\u03bd\u03b5\u03b9 \u03b3\u03c1\u03ae\u03b3\u03bf\u03c1\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03bc\u03b9\u03ba\u03c1\u03ae \u03ba\u03b1\u03b9 \u03b5\u03bb\u03b1\u03c6\u03c1\u03b9\u03ac. \u0391\u03bb\u03bb\u03b9\u03ce\u03c2 \u03c4\u03b1 \u03ac\u03bb\u03bf\u03b3\u03b1 \u03b8\u03b1 \u03b5\u03be\u03b1\u03bd\u03c4\u03bb\u03b7\u03b8\u03bf\u03cd\u03bd \u03c0\u03bf\u03bb\u03cd \u03b5\u03cd\u03ba\u03bf\u03bb\u03b1",
    "S1S4_5": "\u0398\u03b1 \u03ae\u03c4\u03b1\u03bd \u03c5\u03c0\u03ad\u03c1\u03bf\u03c7\u03bf \u03b1\u03bd \u03b7 \u03ac\u03bc\u03b1\u03be\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b5 \u03bd\u03b1 \u03c7\u03c9\u03c1\u03ad\u03c3\u03b5\u03b9 \u03ba\u03ac\u03c0\u03bf\u03b9\u03b1 \u03b1\u03c0\u03cc \u03c4\u03b1 \u03b9\u03b1\u03c4\u03c1\u03b9\u03ba\u03ac \u03bc\u03bf\u03c5 \u03b5\u03c1\u03b3\u03b1\u03bb\u03b5\u03af\u03b1 \u03ba\u03b1\u03b9 \u03c6\u03ac\u03c1\u03bc\u03b1\u03ba\u03b1. \u0398\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b1 \u03bd\u03b1 \u03ad\u03c7\u03c9 \u03c4\u03b1 \u03c0\u03ac\u03bd\u03c4\u03b1 \u03c3\u03c4\u03b7 \u03b4\u03b9\u03ac\u03b8\u03b5\u03c3\u03ae \u03bc\u03bf\u03c5 \u03c3\u03b5 \u03c0\u03b5\u03c1\u03af\u03c0\u03c4\u03c9\u03c3\u03b7 \u03b1\u03bd\u03ac\u03b3\u03ba\u03b7\u03c2.",
    "S1S4_6": "\u03a4\u03bf \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03cc \u03b6\u03b5\u03cd\u03b3\u03bf\u03c2 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c6\u03ac\u03b5\u03b9 \u03b1\u03bb\u03bb\u03ac \u03bc\u03c0\u03bf\u03c1\u03b5\u03af \u03bd\u03b1 \u03b5\u03c0\u03b9\u03bb\u03ad\u03be\u03b5\u03b9 \u03bd\u03b1 \u03bc\u03b5\u03af\u03bd\u03b5\u03b9 \u03c3\u03b5 \u03ba\u03ac\u03c0\u03bf\u03b9\u03bf \u03ac\u03bb\u03bb\u03bf \u03b1\u03c0\u03cc \u03c4\u03b1 \u03c0\u03b1\u03bb\u03ac\u03c4\u03b9\u03b1 \u03c4\u03bf\u03c5 \u03ae \u03c3\u03b5 \u03ba\u03ac\u03c0\u03bf\u03b9\u03bf \u03c3\u03c0\u03af\u03c4\u03b9 \u03b5\u03c0\u03b9\u03c3\u03ba\u03b5\u03c0\u03c4\u03ce\u03bd. \u0394\u03b5\u03bd \u03c5\u03c0\u03ac\u03c1\u03c7\u03b5\u03b9 \u03b1\u03bd\u03ac\u03b3\u03ba\u03b7 \u03b3\u03b9\u03b1 \u03ba\u03ac\u03c0\u03bf\u03b9\u03b1 \u03c6\u03bf\u03c1\u03b7\u03c4\u03ae \u03ba\u03bf\u03c5\u03b6\u03af\u03bd\u03b1.",
    "S1S4_7": "\u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03bb\u03b1\u03c6\u03c1\u03b9\u03ac \u03ba\u03b1\u03b9 \u03b1\u03c0\u03bf\u03c4\u03b5\u03bb\u03b5\u03c3\u03bc\u03b1\u03c4\u03b9\u03ba\u03ae. \u0394\u03b5\u03bd \u03c7\u03c4\u03af\u03b6\u03b5\u03b9\u03c2 \u03ad\u03bd\u03b1\u03bd \u03c0\u03cd\u03c1\u03b3\u03bf \u03c0\u03bf\u03c5 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b1\u03bd\u03c4\u03ad\u03be\u03b5\u03b9 \u03b3\u03b9\u03b1 \u03b1\u03b9\u03ce\u03bd\u03b5\u03c2 \u03b1\u03bb\u03bb\u03ac \u03bc\u03b9\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03b9\u03bf\u03cd. \u039a\u03ac\u03bd\u03b5 \u03c4\u03b7\u03bd \u03b5\u03bb\u03b1\u03c6\u03c1\u03b9\u03ac \u03ba\u03b1\u03b9 \u03b5\u03c5\u03ba\u03af\u03bd\u03b7\u03c4\u03b7!",
    "S1S4_8": "\u039f \u03c7\u03c1\u03cc\u03bd\u03bf\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c7\u03c1\u03ae\u03bc\u03b1 \u03c6\u03af\u03bb\u03b5 \u03bc\u03bf\u03c5. \u0388\u03bd\u03b1\u03c2 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03bc\u03af\u03b1 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03b4\u03b5\u03bd \u03ad\u03c7\u03bf\u03c5\u03bd \u03c7\u03c1\u03cc\u03bd\u03bf \u03b3\u03b9\u03b1 \u03c7\u03ac\u03c3\u03b9\u03bc\u03bf. \u0391\u03c0\u03bb\u03ac \u03ba\u03ac\u03bd\u03b5 \u03c4\u03b7\u03bd \u03b3\u03c1\u03ae\u03b3\u03bf\u03c1\u03b1.",
    "S1S4_9": "\u039a\u03ac\u03bd\u03b5 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03ac\u03bd\u03b5\u03c4\u03b7 \u03b5\u03c0\u03b5\u03b9\u03b4\u03ae \u03bf\u03b9 \u03bb\u03b9\u03b8\u03cc\u03c3\u03c4\u03c1\u03c9\u03c4\u03bf\u03b9 \u03b4\u03c1\u03cc\u03bc\u03bf\u03b9 \u03b5\u03b4\u03ce \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03bf\u03bb\u03cd \u03c3\u03ba\u03bb\u03b7\u03c1\u03bf\u03af\u2026 \u03ba\u03b1\u03b9 \u03bf \u03c0\u03b9\u03c3\u03b9\u03bd\u03cc\u03c2 \u03c4\u03bf\u03c5 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c4\u03b7\u03c2 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1\u03c2 \u03b8\u03b1 \u03c0\u03bf\u03bd\u03ad\u03c3\u03bf\u03c5\u03bd \u03c0\u03bf\u03bb\u03cd \u03ac\u03c3\u03c7\u03b7\u03bc\u03b1\u2026 \u03c3\u03c4\u03bf \u03b4\u03b9\u03b1\u03b2\u03b5\u03b2\u03b1\u03b9\u03ce\u03bd\u03c9 \u03b1\u03c5\u03c4\u03cc",
    "S1S4_10": "\u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b1\u03bd\u03c4\u03b9\u03ba\u03b1\u03c4\u03bf\u03c0\u03c4\u03c1\u03af\u03b6\u03b5\u03b9 \u03c4\u03b7\u03bd \u03c3\u03b7\u03bc\u03b1\u03c3\u03af\u03b1 \u03c4\u03bf\u03c5 \u03c1\u03cc\u03bb\u03bf\u03c5 \u03c4\u03bf\u03c5 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03c3\u03c4\u03bf\u03bd \u03ba\u03cc\u03c3\u03bc\u03bf \u03ba\u03b1\u03b9 \u03c4\u03b7\u03bd \u03b9\u03c3\u03c4\u03bf\u03c1\u03af\u03b1 \u03c4\u03bf\u03c5 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b5\u03af\u03bf\u03c5. \u0395\u03c0\u03bf\u03bc\u03ad\u03bd\u03c9\u03c2 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c6\u03ad\u03c1\u03b5\u03b9 \u03b9\u03c3\u03c4\u03bf\u03c1\u03b9\u03ba\u03ac \u03c3\u03cd\u03bc\u03b2\u03bf\u03bb\u03b1, \u03b7 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b3\u03af\u03bd\u03b5\u03b9 \u03ad\u03bd\u03b1 \u03b8\u03c1\u03c5\u03bb\u03b9\u03ba\u03cc \u03ad\u03c1\u03b3\u03bf \u03c4\u03ad\u03c7\u03bd\u03b7\u03c2\u00a8",
    "S1S4_11": "\u03a6\u03cd\u03b3\u03b5 \u03b1\u03c0\u03cc \u03b5\u03b4\u03ce, \u03b1\u03b3\u03cc\u03c1\u03b9\/\u03ba\u03bf\u03c1\u03af\u03c4\u03c3\u03b9, \u03c5\u03c0\u03ac\u03c1\u03c7\u03bf\u03c5\u03bd \u03ac\u03bd\u03b8\u03c1\u03c9\u03c0\u03bf\u03b9 \u03c0\u03bf\u03c5 \u03b4\u03bf\u03c5\u03bb\u03b5\u03cd\u03bf\u03c5\u03bd \u03b5\u03b4\u03ce!",
    "S1S4_12": "\u039c\u03b7\u03bd \u03b1\u03c6\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03ae \u03bf\u03b9\u03ba\u03bf\u03b3\u03ad\u03bd\u03b5\u03b9\u03b1 \u03bd\u03b1 \u03ba\u03b1\u03c4\u03b1\u03c3\u03c4\u03c1\u03ad\u03c8\u03bf\u03c5\u03bd \u03bf\u03b9\u03ba\u03bf\u03bd\u03bf\u03bc\u03b9\u03ba\u03ac \u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf \u03bc\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1. \u0388\u03c7\u03bf\u03c5\u03bd \u03ae\u03b4\u03b7 \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b1 \u03b1\u03c0\u03cc \u03b5\u03bc\u03ac\u03c2, \u03c4\u03bf\u03bd \u03ba\u03cc\u03c3\u03bc\u03bf. \u039a\u03ac\u03bd\u03b5 \u03c4\u03b7\u03bd \u03b1\u03c0\u03bb\u03ae.",
    "S1S4_13": "\u0391\u03c5\u03c4\u03cc\u03c2 \u03c0\u03bf\u03c5 \u03b8\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03ad\u03c8\u03b5\u03b9 \u03c7\u03b1\u03c1\u03bf\u03cd\u03bc\u03b5\u03bd\u03bf\u03c2 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03ad\u03c8\u03b5\u03b9 \u03b5\u03bb\u03b1\u03c6\u03c1\u03cd\u03c2. Antoine de St Exupery",
    "S1S4_14": "\u0394\u03b5\u03bd \u03ad\u03c7\u03c9 \u03c7\u03c1\u03cc\u03bd\u03bf \u03b3\u03b9\u03b1 \u03c3\u03c5\u03b6\u03ae\u03c4\u03b7\u03c3\u03b7. \u0388\u03c7\u03c9 \u03bd\u03b1 \u03ba\u03c5\u03bd\u03b7\u03b3\u03ae\u03c3\u03c9 \u03b3\u03b9\u03b1 \u03ba\u03c1\u03ad\u03b1\u03c2.",
    "S1S5_1": "\u03a4\u03ce\u03c1\u03b1 \u03c0\u03bf\u03c5 \u03c3\u03c5\u03b3\u03ba\u03ad\u03bd\u03c4\u03c1\u03c9\u03c3\u03b5\u03c2 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ad\u03c2 \u03b3\u03bd\u03ce\u03bc\u03b5\u03c2 \u03b8\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b5\u03c2 \u03bd\u03b1 \u03b3\u03c5\u03c1\u03af\u03c3\u03b5\u03b9\u03c2 \u03c3\u03c4\u03bf\u03bd \u03b5\u03c1\u03b3\u03b1\u03c3\u03c4\u03ae\u03c1\u03b9\u03cc \u03c3\u03bf\u03c5 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03be\u03b5\u03ba\u03b9\u03bd\u03ae\u03c3\u03b5\u03b9\u03c2 \u03bd\u03b1 \u03b4\u03bf\u03c5\u03bb\u03b5\u03cd\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03ae \u03bd\u03b1 \u03c3\u03c5\u03bd\u03b5\u03c7\u03af\u03c3\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03c0\u03b5\u03c1\u03b9\u03ae\u03b3\u03b7\u03c3\u03ae \u03c3\u03bf\u03c5 \u03c0\u03c1\u03bf\u03ba\u03b5\u03b9\u03bc\u03ad\u03bd\u03bf\u03c5 \u03bd\u03b1 \u03c3\u03c5\u03bd\u03b1\u03bd\u03c4\u03ae\u03c3\u03b5\u03b9\u03c2 \u03ba\u03b1\u03b9 \u03ac\u03bb\u03bb\u03bf\u03c5\u03c2 \u03b1\u03bd\u03b8\u03c1\u03ce\u03c0\u03bf\u03c5\u03c2.",
    "S2S0": "\u039a\u03b1\u03bb\u03c9\u03c3\u03ae\u03c1\u03b8\u03b5\u03c2 \u03c0\u03af\u03c3\u03c9 \u03c3\u03c4\u03bf \u03b5\u03c1\u03b3\u03b1\u03c3\u03c4\u03ae\u03c1\u03b9\u03cc \u03c3\u03bf\u03c5! \u0392\u03ac\u03c3\u03b5\u03b9 \u03cc\u03bb\u03c9\u03bd \u03b1\u03c5\u03c4\u03ce\u03bd \u03c0\u03bf\u03c5 \u03ad\u03c7\u03b5\u03b9\u03c2 \u03b1\u03ba\u03bf\u03cd\u03c3\u03b5\u03b9 \u03ae\u03c1\u03b8\u03b5 \u03b7 \u03ce\u03c1\u03b1 \u03bd\u03b1 \u03ba\u03ac\u03bd\u03b5\u03b9\u03c2 \u03ba\u03ac\u03c0\u03bf\u03b9\u03b5\u03c2 \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ad\u03c2 \u03c3\u03c7\u03b5\u03c4\u03b9\u03ba\u03ac \u03bc\u03b5 \u03c4\u03bf\u03bd \u03c4\u03cd\u03c0\u03bf \u03c4\u03b7\u03c2 \u03ac\u03bc\u03b1\u03be\u03b1\u03c2 \u03c0\u03bf\u03c5 \u03c0\u03b9\u03c3\u03c4\u03b5\u03cd\u03b5\u03b9\u03c2 \u03cc\u03c4\u03b9 \u03b8\u03b1 \u03c4\u03b1\u03b9\u03c1\u03b9\u03ac\u03b6\u03b5\u03b9 \u03ba\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b1 \u03c3\u03c4\u03b9\u03c2 \u03b1\u03bd\u03ac\u03b3\u03ba\u03b5\u03c2 \u03c4\u03bf \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c4\u03b7\u03c2 \u0392\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1\u03c2.",
    "S2L1": "\u0391\u03c1\u03b3\u03ae",
    "S2L2": "\u0393\u03c1\u03ae\u03b3\u03bf\u03c1\u03b7",
    "S2L3": "\u03a4\u03c1\u03b1\u03c7\u03b9\u03ac",
    "S2L4": "\u03a6\u03b1\u03bd\u03c4\u03b1\u03c7\u03c4\u03b5\u03c1\u03ae",
    "S2L5": "\u0386\u03bd\u03b5\u03c4\u03b7",
    "S2L6": "\u0386\u03bd\u03b5\u03c4\u03b7 \u03ba\u03b1\u03b9 \u03c0\u03bf\u03bb\u03c5\u03c4\u03b5\u03bb\u03b5\u03af\u03c2",
    "S2L7": "\u039c\u03b9\u03ba\u03c1\u03ae",
    "S2L8": "\u039c\u03b5\u03b3\u03ac\u03bb\u03b7",
    "S2L9": "\u0395\u03bb\u03b1\u03c6\u03c1\u03b9\u03ac",
    "S2L10": "\u039f \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03bf\u03c4\u03b9\u03bc\u03bf\u03cd\u03c3\u03b1\u03bd \u03bd\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03b5\u03cd\u03bf\u03c5\u03bd \u03bc\u03b5 \u03bc\u03b5\u03b3\u03ac\u03bb\u03b7 \u03c4\u03b1\u03c7\u03cd\u03c4\u03b7\u03c4\u03b1 \u03ae \u03bd\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03b5\u03cd\u03bf\u03c5\u03bd \u03c0\u03b9\u03bf \u03b1\u03c1\u03b3\u03ac \u03b1\u03bb\u03bb\u03ac \u03bc\u03b5 \u03b1\u03c3\u03c6\u03ac\u03bb\u03b5\u03b9\u03b1 \u03c3\u03b5 \u03cc\u03bb\u03bf\u03c5\u03c2 \u03c4\u03bf\u03c5\u03c2 \u03c4\u03cd\u03c0\u03bf\u03c5\u03c2 \u03b4\u03c1\u03cc\u03bc\u03c9\u03bd;",
    "S2L11": "\u039f \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03bf\u03c4\u03b9\u03bc\u03bf\u03cd\u03c3\u03b1\u03bd \u03ad\u03bd\u03b1 \u03b1\u03bd\u03b8\u03b5\u03ba\u03c4\u03b9\u03ba\u03cc \u03bc\u03b5\u03c4\u03b1\u03c6\u03bf\u03c1\u03b9\u03ba\u03cc \u03bc\u03ad\u03c3\u03bf \u03ae \u03c6\u03b1\u03bd\u03c4\u03b1\u03c7\u03c4\u03b5\u03c1\u03cc \u03cc\u03c7\u03b7\u03bc\u03b1;",
    "S2L12": "\u039f \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03bf\u03c4\u03b9\u03bc\u03bf\u03cd\u03c3\u03b1\u03bd \u03bc\u03b9\u03b1 \u03bc\u03b9\u03bd\u03b9\u03bc\u03b1\u03bb\u03b9\u03c3\u03c4\u03b9\u03ba\u03ae \u03b1\u03bb\u03bb\u03ac \u03c0\u03c1\u03b1\u03ba\u03c4\u03b9\u03ba\u03ae \u03ac\u03bc\u03b1\u03be\u03b1 \u03ae \u03bc\u03b9\u03b1 \u03c0\u03bf\u03bb\u03c5\u03c4\u03b5\u03bb\u03ad\u03c3\u03c4\u03b1\u03c4\u03b7 \u03ac\u03bc\u03b1\u03be\u03b1;",
    "S2L13": "\u039f \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03bf\u03c4\u03b9\u03bc\u03bf\u03cd\u03c3\u03b1\u03bd \u03bc\u03b9\u03b1 \u03bc\u03b9\u03ba\u03c1\u03ae \u03ba\u03b1\u03b9 \u03b3\u03c1\u03ae\u03b3\u03bf\u03c1\u03b7 \u03ac\u03bc\u03b1\u03be\u03b1 \u03ae \u03bc\u03b9\u03b1 \u03b5\u03c5\u03c1\u03cd\u03c7\u03c9\u03c1\u03b7 \u03ba\u03b1\u03b9 \u03b1\u03c1\u03b3\u03ae \u03ac\u03bc\u03b1\u03be\u03b1;",
    "S2L14": "\u039f \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03bf\u03c4\u03b9\u03bc\u03bf\u03cd\u03c3\u03b1\u03bd \u03bc\u03b9\u03b1 \u03b5\u03bb\u03b1\u03c6\u03c1\u03b9\u03ac \u03ac\u03bc\u03b1\u03be\u03b1 \u03ae \u03bc\u03b9\u03b1 \u03b2\u03b1\u03c1\u03b9\u03ac \u03ba\u03b1\u03b9 \u03b3\u03b5\u03c1\u03ae \u03ac\u03bc\u03b1\u03be\u03b1;",
    "S2L15": "\u0394\u03c5\u03bd\u03b1\u03c4\u03ae",
    "S2S1": "\u03a6\u03af\u03bb\u03b5 \u03bc\u03bf\u03c5, \u03c6\u03b1\u03af\u03bd\u03b5\u03c4\u03b1\u03b9 \u03cc\u03c4\u03b9 \u03b4\u03b5\u03bd \u03ad\u03c7\u03b5\u03b9\u03c2 \u03c0\u03ac\u03c1\u03b5\u03b9 \u03c0\u03c1\u03b1\u03b3\u03bc\u03b1\u03c4\u03b9\u03ba\u03ad\u03c2 \u03b1\u03c0\u03bf\u03c6\u03ac\u03c3\u03b5\u03b9\u03c2. \u039c\u03af\u03b1 \u03bc\u03b5\u03c3\u03b1\u03af\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b4\u03b5\u03bd \u03b8\u03b1 \u03c4\u03b1\u03b9\u03c1\u03b9\u03ac\u03b6\u03b5\u03b9 \u03c3\u03c4\u03b9\u03c2 \u03b1\u03bd\u03ac\u03b3\u03ba\u03b5\u03c2 \u03c4\u03bf\u03c5 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c4\u03b7\u03c2 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1\u03c2. \u03a0\u03ac\u03c1\u03b5 \u03c0\u03c1\u03b1\u03b3\u03bc\u03b1\u03c4\u03b9\u03ba\u03ad\u03c2 \u03b1\u03c0\u03bf\u03c6\u03ac\u03c3\u03b5\u03b9\u03c2.",
    "S2S2": "\u03a4\u03b9 \u03b5\u03bb\u03c0\u03b9\u03b4\u03bf\u03c6\u03cc\u03c1\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1! \u039c\u03c0\u03c1\u03ac\u03b2\u03bf! (\u03a4\u03b9 \u03b5\u03bb\u03c0\u03b9\u03b4\u03bf\u03c6\u03cc\u03c1\u03b1 \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ae \u03ac\u03bc\u03b1\u03be\u03b1\u03c2!)",
    "S3S1_1": "\u03a0\u03c1\u03b9\u03bd \u03c0\u03c1\u03bf\u03c7\u03c9\u03c1\u03ae\u03c3\u03bf\u03c5\u03bc\u03b5 \u03c0\u03b1\u03c1\u03b1\u03c0\u03ad\u03c1\u03b1 \u03bc\u03b5 \u03c4\u03bf \u03c3\u03c7\u03ad\u03b4\u03b9\u03bf \u03bc\u03b1\u03c2 \u03af\u03c3\u03c9\u03c2 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03be\u03b5\u03c4\u03ac\u03c3\u03bf\u03c5\u03bc\u03b5 \u03c4\u03b9\u03c2 \u03c5\u03c0\u03ac\u03c1\u03c7\u03bf\u03c5\u03c3\u03b5\u03c2 \u03ac\u03bc\u03b1\u03be\u03b5\u03c2 \u03c4\u03c9\u03bd \u03ac\u03bb\u03bb\u03c9\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03b4\u03c9\u03bd. \u0391\u03c5\u03c4\u03cc \u03af\u03c3\u03c9\u03c2 \u03bc\u03b1\u03c2 \u03b5\u03bc\u03c0\u03bd\u03b5\u03cd\u03c3\u03b5\u03b9.",
    "S3S1_2": "\u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c4\u03b7\u03c2 \u0392\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1\u03c2 \u03a0\u03b1\u03c4\u03c1\u03af\u03c3\u03b9\u03b1\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03c4\u03b1\u03c7\u03cd\u03c4\u03b5\u03c1\u03b7 \u03c3\u03b5 \u03cc\u03bb\u03bf \u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf \u03b1\u03bb\u03bb\u03ac \u03c3\u03c5\u03c7\u03bd\u03ac \u03b1\u03c0\u03bf\u03c4\u03c5\u03b3\u03c7\u03ac\u03bd\u03b5\u03b9 \u03ba\u03b1\u03b9 \u03c3\u03c0\u03ac\u03b5\u03b9.",
    "S3S1_3": "\u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c4\u03b7\u03c2 \u0392\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1\u03c2 \u039c\u03b9\u03c7\u03b1\u03ad\u03bb\u03b1\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03c0\u03b9\u03bf \u03cc\u03bc\u03bf\u03c1\u03c6\u03b7 \u03b1\u03bb\u03bb\u03ac \u03cc\u03c7\u03b9 \u03c4\u03cc\u03c3\u03bf \u03ac\u03bd\u03b5\u03c4\u03b7, \u03b5\u03bb\u03b1\u03c6\u03c1\u03ce\u03c2 \u03b2\u03b1\u03c1\u03b9\u03ac \u03ba\u03b1\u03b9 \u03b5\u03c6\u03b9\u03ac\u03bb\u03c4\u03b7\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c4\u03b7 \u03ba\u03b1\u03b8\u03b1\u03c1\u03af\u03c3\u03b5\u03b9\u03c2 (\u03b7 \u03bb\u03ac\u03c3\u03c0\u03b7 \u03ba\u03bf\u03bb\u03bb\u03ac\u03b5\u03b9 \u03c3\u03b5 \u03cc\u03bb\u03b1 \u03c4\u03b1 \u03b4\u03b9\u03b1\u03ba\u03bf\u03c3\u03bc\u03b7\u03c4\u03b9\u03ba\u03ac \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1 \u03c4\u03c9\u03bd \u03b5\u03be\u03c9\u03c4\u03b5\u03c1\u03b9\u03ba\u03ce\u03bd \u03c4\u03bf\u03af\u03c7\u03c9\u03bd)",
    "S3S1_4": "\u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c4\u03bf\u03c5 \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03a0\u03ac\u03bc\u03c0\u03bb\u03bf \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03c0\u03b9\u03bf \u03b4\u03c5\u03bd\u03b1\u03c4\u03ae \u03c3\u03b5 \u03cc\u03bb\u03bf \u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf. \u0388\u03c7\u03b5\u03b9 \u03b5\u03c0\u03b9\u03b2\u03b9\u03ce\u03c3\u03b5\u03b9 \u03b1\u03c0\u03cc \u03cc\u03bb\u03bf\u03c5\u03c2 \u03c4\u03bf\u03c5\u03c2 \u03ba\u03b1\u03ba\u03bf\u03cd\u03c2 \u03b4\u03c1\u03cc\u03bc\u03bf\u03c5\u03c2 \u03ba\u03b1\u03b9 \u03b1\u03c0\u03cc \u03c0\u03bf\u03bb\u03bb\u03ad\u03c2 \u03b5\u03c0\u03b9\u03b8\u03ad\u03c3\u03b5\u03b9\u03c2 \u03ba\u03b1\u03b9 \u03c0\u03ac\u03bd\u03c4\u03b1 \u03b5\u03c0\u03b9\u03c4\u03cd\u03b3\u03c7\u03b1\u03bd\u03b5 \u03bd\u03b1 \u03ba\u03c1\u03b1\u03c4\u03ac\u03b5\u03b9 \u03b1\u03c3\u03c6\u03b1\u03bb\u03b5\u03af\u03c2 \u03c4\u03bf\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c4\u03b7\u03bd \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1.",
    "S3S1_5": "\u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c4\u03b7\u03c2 \u0392\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1\u03c2 \u0386\u03bd\u03bd\u03b1\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03c0\u03b9\u03bf \u03ac\u03bd\u03b5\u03c4\u03b7. \u0391\u03ba\u03cc\u03bc\u03b1 \u03ba\u03b1\u03b9 \u03c4\u03bf \u03ba\u03ac\u03b8\u03b9\u03c3\u03bc\u03b1 \u03c4\u03bf\u03c5 \u03bf\u03b4\u03b7\u03b3\u03bf\u03cd \u03c4\u03b7\u03c2 \u03ac\u03bc\u03b1\u03be\u03b1\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c6\u03c4\u03b9\u03b1\u03b3\u03bc\u03ad\u03bd\u03bf \u03b1\u03c0\u03cc \u03bc\u03b1\u03bb\u03b1\u03ba\u03ac \u03ba\u03b1\u03b9 \u03ac\u03bd\u03b5\u03c4\u03b1 \u03c5\u03bb\u03b9\u03ba\u03ac. \u039a\u03ac\u03bd\u03b5\u03b9 \u03ba\u03ac\u03b8\u03b5 \u03c4\u03b1\u03be\u03af\u03b4\u03b9 \u03c0\u03bf\u03bb\u03cd \u03b5\u03c5\u03c7\u03ac\u03c1\u03b9\u03c3\u03c4\u03bf.",
    "S3S1_6": "\u0397 \u03ac\u03bc\u03b1\u03be\u03b1 \u03c4\u03bf\u03c5 \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u0398\u03b1\u03c1\u03c1\u03b5\u03bd\u03bf\u03cd \u03b5\u03af\u03bd\u03b1\u03b9 \u03b7 \u03bc\u03b5\u03b3\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b7. \u03a0\u03c1\u03bf\u03c3\u03c6\u03ad\u03c1\u03b5\u03b9 \u03bc\u03b5\u03b3\u03ac\u03bb\u03bf \u03c7\u03ce\u03c1\u03bf. \u03a4\u03b1\u03be\u03b9\u03b4\u03b5\u03cd\u03bf\u03bd\u03c4\u03b1\u03c2 \u03bc\u03b5 \u03b1\u03c5\u03c4\u03ae\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03c3\u03b1\u03bd \u03bd\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03b5\u03cd\u03b5\u03b9\u03c2 \u03c7\u03c9\u03c1\u03af\u03c2 \u03bd\u03b1 \u03b2\u03b3\u03b1\u03af\u03bd\u03b5\u03b9\u03c2 \u03b1\u03c0\u03cc \u03c4\u03bf \u03c3\u03b1\u03bb\u03cc\u03bd\u03b9 \u03c3\u03bf\u03c5.",
    "S3S3_1": "\u0395\u03bb\u03c0\u03af\u03b6\u03c9 \u03b1\u03c5\u03c4\u03ae \u03b7 \u03bc\u03b9\u03ba\u03c1\u03ae \u03c0\u03b5\u03c1\u03b9\u03ae\u03b3\u03b7\u03c3\u03b7 \u03c3\u03c4\u03b9\u03c2 \u03ac\u03bc\u03b1\u03be\u03b5\u03c2 \u03c4\u03c9\u03bd \u03ac\u03bb\u03bb\u03c9\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03b4\u03c9\u03bd \u03ba\u03b1\u03b9 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03c3\u03c3\u03ce\u03bd \u03bd\u03b1 \u03c3\u03b5 \u03b5\u03bd\u03ad\u03c0\u03bd\u03b5\u03c5\u03c3\u03b5! \u03a4\u03ce\u03c1\u03b1 \u03b1\u03c2 \u03c3\u03c5\u03bd\u03b5\u03c7\u03af\u03c3\u03bf\u03c5\u03bc\u03b5 \u03bc\u03b5 \u03c4\u03b7 \u03b4\u03b9\u03ba\u03ae \u03bc\u03b1\u03c2.",
    "S4S1_1": "\u039c\u03b5 \u03cc\u03bb\u03b5\u03c2 \u03c4\u03b9\u03c2 \u03c0\u03bb\u03b7\u03c1\u03bf\u03c6\u03bf\u03c1\u03af\u03b5\u03c2 \u03c0\u03bf\u03c5 \u03c3\u03c5\u03bd\u03ad\u03bb\u03b5\u03be\u03b5\u03c2 \u03b1\u03c0\u03cc \u03c4\u03bf\u03c5\u03c2 \u03b1\u03bd\u03b8\u03c1\u03ce\u03c0\u03bf\u03c5\u03c2 \u03c0\u03bf\u03c5 \u03b3\u03bd\u03ce\u03c1\u03b9\u03c3\u03b5\u03c2, \u03c4\u03b9\u03c2 \u03c5\u03c0\u03ac\u03c1\u03c7\u03bf\u03c5\u03c3\u03b5\u03c2 \u03ac\u03bc\u03b1\u03be\u03b5\u03c2 \u03c0\u03bf\u03c5 \u03b5\u03af\u03b4\u03b5\u03c2 \u03ba\u03b1\u03b9 \u03c4\u03b7\u03bd \u03b4\u03b9\u03ba\u03ae \u03c3\u03bf\u03c5 \u03bf\u03c0\u03c4\u03b9\u03ba\u03ae \u03b3\u03c9\u03bd\u03af\u03b1 \u03ba\u03b1\u03b9 \u03b4\u03b9\u03b1\u03af\u03c3\u03b8\u03b7\u03c3\u03b7, \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03bb\u03ad\u03bf\u03bd \u03ba\u03b1\u03b9\u03c1\u03cc\u03c2 \u03bd\u03b1 \u03be\u03b5\u03ba\u03b9\u03bd\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c4\u03bf \u03c0\u03c1\u03c9\u03c4\u03cc\u03c4\u03c5\u03c0\u03bf \u03c4\u03b7\u03c2 \u03ac\u03bc\u03b1\u03be\u03b1\u03c2.",
    "S4S2_1": "\u0397 \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03ac\u03c1\u03b1 \u03c0\u03bf\u03bb\u03cd \u03c6\u03b8\u03b7\u03bd\u03ae. \u03a6\u03c4\u03b9\u03ac\u03c7\u03bd\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03c4\u03b7\u03c2 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03ae\u03c2 \u03bf\u03b9\u03ba\u03bf\u03b3\u03ad\u03bd\u03b5\u03b9\u03b1\u03c2! \u038c\u03c7\u03b9 \u03c4\u03bf \u03ba\u03b1\u03bb\u03ac\u03b8\u03b9 \u03b5\u03bd\u03cc\u03c2 \u03b5\u03bc\u03c0\u03cc\u03c1\u03bf\u03c5!",
    "S4S2_2": "\u0397 \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c4\u03cc\u03c3\u03bf \u03b1\u03c0\u03bb\u03ae \u03c0\u03bf\u03c5 \u03b8\u03b1 \u03c3\u03bf\u03c5 \u03c0\u03ac\u03c1\u03b5\u03b9 \u03bc\u03cc\u03bd\u03bf \u03b4\u03cd\u03bf \u03b5\u03b2\u03b4\u03bf\u03bc\u03ac\u03b4\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c4\u03b7 \u03c6\u03c4\u03b9\u03ac\u03be\u03b5\u03b9\u03c2. \u039c\u03c0\u03bf\u03c1\u03bf\u03cd\u03bc\u03b5 \u03bd\u03b1 \u03b5\u03c0\u03b5\u03bd\u03b4\u03cd\u03c3\u03bf\u03c5\u03bc\u03b5 \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03bf \u03c7\u03c1\u03cc\u03bd\u03bf \u03b1\u03c6\u03bf\u03cd \u03ad\u03c7\u03bf\u03c5\u03bc\u03b5 6 \u03bc\u03ae\u03bd\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c4\u03b7\u03bd \u03c0\u03b1\u03c1\u03b1\u03b4\u03ce\u03c3\u03bf\u03c5\u03bc\u03b5. \u0391\u03c2 \u03b2\u03b5\u03bb\u03c4\u03b9\u03ce\u03c3\u03bf\u03c5\u03bc\u03b5 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03ac \u03bc\u03b1\u03c2!",
    "S4S2_3": "\u0397 \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03ac\u03c1\u03b1 \u03c0\u03bf\u03bb\u03cd \u03b2\u03b1\u03c1\u03b9\u03ac \u03ba\u03b1\u03b9 \u03b1\u03c1\u03b3\u03ae. \u03a4\u03b1 \u03c4\u03b1\u03be\u03af\u03b4\u03b9\u03b1 \u03b8\u03b1 \u03b4\u03b9\u03b1\u03c1\u03ba\u03bf\u03cd\u03bd \u03c0\u03ac\u03c1\u03b1 \u03c0\u03bf\u03bb\u03cd.",
    "S4S2_4": "\u0397 \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03bf\u03bb\u03cd \u03c4\u03c1\u03b1\u03c7\u03b9\u03ac \u03b3\u03b9\u03b1 \u03bc\u03b9\u03b1 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03ae \u03ac\u03bc\u03b1\u03be\u03b1, \u03b5\u03af\u03bd\u03b1\u03b9 \u03c3\u03b1\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03c7\u03c9\u03c1\u03b9\u03ba\u03bf\u03cd.",
    "S4S2_5": "\u03a0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c6\u03c4\u03b9\u03ac\u03be\u03b5\u03b9\u03c2 \u03bc\u03af\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1 \u03cc\u03c7\u03b9 \u03ad\u03bd\u03b1 \u03ac\u03c1\u03bc\u03b1. \u039a\u03ac\u03bd\u03b5 \u03c4\u03b7\u03bd \u03c0\u03b9\u03bf \u03ac\u03bd\u03b5\u03c4\u03b7!",
    "S4S2_6": "\u0397 \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c0\u03bf\u03bb\u03cd \u03b5\u03cd\u03b8\u03c1\u03b1\u03c5\u03c3\u03c4\u03b7 \u03cc\u03c0\u03c9\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c6\u03c4\u03b9\u03b1\u03b3\u03bc\u03ad\u03bd\u03b7. \u0398\u03b1 \u03b3\u03af\u03bd\u03b5\u03b9 \u03ba\u03bf\u03bc\u03bc\u03ac\u03c4\u03b9\u03b1 \u03c3\u03c4\u03bf \u03c0\u03c1\u03ce\u03c4\u03bf \u03bb\u03b9\u03b8\u03cc\u03c3\u03c4\u03c1\u03c9\u03c4\u03bf \u03b4\u03c1\u03cc\u03bc\u03bf.",
    "S4S2_7": "\u039a\u03b1\u03c4\u03b1\u03c3\u03c4\u03c1\u03ad\u03c6\u03b5\u03b9\u03c2 \u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf! \u039e\u03b1\u03bd\u03b1\u03c3\u03ba\u03ad\u03c8\u03bf\u03c5 \u03c4\u03bf \u03c3\u03c7\u03ad\u03b4\u03b9\u03bf \u03c3\u03bf\u03c5 \u03b5\u03c0\u03b9\u03bb\u03ad\u03b3\u03bf\u03bd\u03c4\u03b1\u03c2 \u03bb\u03b9\u03b3\u03cc\u03c4\u03b5\u03c1\u03bf \u03b1\u03ba\u03c1\u03b9\u03b2\u03ac \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1.",
    "S4S2_8": "\u0397 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03ae \u03bf\u03b9\u03ba\u03bf\u03b3\u03ad\u03bd\u03b5\u03b9\u03b1 \u03c7\u03c1\u03b5\u03b9\u03ac\u03b6\u03b5\u03c4\u03b1\u03b9 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03c3\u03b5 \u03b4\u03b9\u03ac\u03c3\u03c4\u03b7\u03bc\u03b1 6 \u03bc\u03b7\u03bd\u03ce\u03bd. \u0394\u03b9\u03ac\u03bb\u03b5\u03be\u03b5 \u03ba\u03ac\u03c0\u03bf\u03b9\u03b1 \u03c0\u03b9\u03bf \u03b1\u03c0\u03bb\u03ac \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03bc\u03b5\u03b9\u03ce\u03c3\u03b5\u03b9\u03c2 \u03c4\u03bf\u03bd \u03c7\u03c1\u03cc\u03bd\u03bf \u03ba\u03b1\u03c4\u03b1\u03c3\u03ba\u03b5\u03c5\u03ae\u03c2.",
    "S4S3_1": "\u03a0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b2\u03b5\u03bb\u03c4\u03b9\u03ce\u03c3\u03b5\u03b9\u03c2 \u03c4\u03bf\u03bd \u03c3\u03c7\u03ad\u03b4\u03b9\u03bf \u03c3\u03bf\u03c5 \u03c0\u03c1\u03b9\u03bd \u03c0\u03c1\u03bf\u03c7\u03c9\u03c1\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c0\u03b1\u03c1\u03b1\u03c0\u03ad\u03c1\u03b1.",
    "S4S3_2": "\u0395\u03bd\u03c4\u03ac\u03be\u03b5\u03b9! \u0391\u03c2 \u03c0\u03c1\u03bf\u03c7\u03c9\u03c1\u03ae\u03c3\u03bf\u03c5\u03bc\u03b5 \u03bc\u03b5 \u03c3\u03c4\u03b7 \u03b4\u03bf\u03ba\u03b9\u03bc\u03ae \u03c4\u03cc\u03c4\u03b5!",
    "S5S0_1": "\u03a4\u03ce\u03c1\u03b1 \u03c0\u03bf\u03c5 \u03c4\u03bf \u03c0\u03c1\u03c9\u03c4\u03cc\u03c4\u03c5\u03c0\u03cc \u03c3\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03c4\u03bf\u03b9\u03bc\u03bf, \u03b1\u03c2 \u03c4\u03b7 \u03b4\u03b5\u03af\u03be\u03bf\u03c5\u03bc\u03b5 \u03c3\u03b5 \u03bc\u03b5\u03c1\u03b9\u03ba\u03bf\u03cd\u03c2 \u03b1\u03bd\u03b8\u03c1\u03ce\u03c0\u03bf\u03c5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03b4\u03bf\u03cd\u03bc\u03b5 \u03c4\u03b9 \u03c0\u03b9\u03c3\u03c4\u03b5\u03cd\u03bf\u03c5\u03bd \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1, \u03c0\u03c1\u03b9\u03bd \u03c4\u03b7\u03bd \u03c0\u03b1\u03c1\u03bf\u03c5\u03c3\u03b9\u03ac\u03c3\u03bf\u03c5\u03bc\u03b5 \u03c3\u03c4\u03bf\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac",
    "S5S1_1": "\u039b\u03bf\u03b9\u03c0\u03cc\u03bd, \u03bc\u03bf\u03c5 \u03bc\u03bf\u03b9\u03ac\u03b6\u03b5\u03b9 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ac \u03b4\u03c5\u03bd\u03b1\u03c4\u03ae. \u03a0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c4\u03b7 \u03b4\u03bf\u03ba\u03b9\u03bc\u03ac\u03c3\u03b5\u03b9\u03c2 \u03c0\u03c1\u03b9\u03bd \u03c4\u03b7\u03bd \u03b4\u03ce\u03c3\u03b5\u03b9\u03c2 \u03c3\u03c4\u03bf\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c4\u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1",
    "S5S1_2": "\u039c\u03c0\u03c1\u03ac\u03b2\u03bf. \u03a6\u03af\u03bb\u03b5 \u03bc\u03bf\u03c5. \u0391\u03c5\u03c4\u03ae \u03b5\u03af\u03bd\u03b1\u03b9 \u03bc\u03b9\u03b1 \u03c9\u03c1\u03b1\u03af\u03b1 \u03ac\u03bc\u03b1\u03be\u03b1. \u0391\u03bb\u03bb\u03ac \u03c0\u03b9\u03c3\u03c4\u03b5\u03cd\u03b5\u03b9\u03c2 \u03cc\u03c4\u03b9 \u03bc\u03c0\u03bf\u03c1\u03b5\u03af \u03bd\u03b1 \u03b4\u03b9\u03b1\u03c3\u03c7\u03af\u03c3\u03b5\u03b9 \u03c4\u03bf\u03c5\u03c2 \u03c3\u03c4\u03b5\u03bd\u03bf\u03cd\u03c2 \u03b4\u03c1\u03cc\u03bc\u03bf\u03c5\u03c2; \u03a0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c4\u03bf \u03b4\u03bf\u03ba\u03b9\u03bc\u03ac\u03c3\u03b5\u03b9\u03c2 \u03c0\u03c1\u03b9\u03bd \u03c4\u03b7\u03bd \u03c0\u03b1\u03c1\u03b1\u03b4\u03ce\u03c3\u03b5\u03b9\u03c2.",
    "S5S1_3": "\u0394\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ba\u03b1\u03ba\u03cc. \u0394\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ba\u03b1\u03b8\u03cc\u03bb\u03bf\u03c5 \u03ba\u03b1\u03ba\u03cc \u03b8\u03b1 \u03ad\u03bb\u03b5\u03b3\u03b1. \u038c\u03bc\u03c9\u03c2 \u03c0\u03b9\u03c3\u03c4\u03b5\u03cd\u03b5\u03b9\u03c2 \u03cc\u03c4\u03b9 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ac \u03c6\u03b1\u03bd\u03c4\u03b1\u03c7\u03c4\u03b5\u03c1\u03ae \u03b1\u03bd \u03c4\u03bf \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03cc \u03b6\u03b5\u03cd\u03b3\u03bf\u03c2 \u03ad\u03c7\u03b5\u03b9 \u03bd\u03b1 \u03c0\u03ac\u03b5\u03b9 \u03c3\u03b5 \u03bc\u03af\u03b1 \u03c4\u03b5\u03bb\u03b5\u03c4\u03ae; \u0398\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c1\u03c9\u03c4\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c4\u03bf\u03bd \u03ba\u03cc\u03c3\u03bc\u03bf \u03c4\u03b9 \u03c0\u03b9\u03c3\u03c4\u03b5\u03cd\u03b5\u03b9 \u03c0\u03c1\u03b9\u03bd \u03c4\u03b7\u03bd \u03c0\u03b1\u03c1\u03b1\u03b4\u03ce\u03c3\u03b5\u03b9\u03c2 \u03c4\u03bf\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c4\u03b7 \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1.",
    "S5S1_4": "\u03a3\u03c5\u03b3\u03b3\u03bd\u03ce\u03bc\u03b7 \u03c6\u03af\u03bb\u03b5, \u03b4\u03b5\u03bd \u03ad\u03c7\u03c9 \u03c7\u03c1\u03cc\u03bd\u03bf \u03b3\u03b9\u03b1 \u03c3\u03c5\u03b6\u03ae\u03c4\u03b7\u03c3\u03b7.",
    "S5S1_5": "\u0388\u03c7\u03c9 \u03b4\u03bf\u03c5\u03bb\u03b5\u03b9\u03ac \u03bd\u03b1 \u03ba\u03ac\u03bd\u03c9. \u03a1\u03ce\u03c4\u03b7\u03c3\u03b5 \u03ba\u03ac\u03c0\u03bf\u03b9\u03bf\u03bd \u03ac\u03bb\u03bb\u03bf\u03bd.",
    "S5S1_6": "\u03a7\u03bc;",
    "S5S1_7": "\u039c\u03b5 \u03b2\u03ac\u03c3\u03b7 \u03c4\u03b1 \u03c3\u03c7\u03cc\u03bb\u03b9\u03b1 \u03c0\u03bf\u03c5 \u03bc\u03cc\u03bb\u03b9\u03c2 \u03ad\u03bb\u03b1\u03b2\u03b5\u03c2, \u03b8\u03b1 \u03ae\u03b8\u03b5\u03bb\u03b5\u03c2 \u03bd\u03b1 \u03b1\u03bd\u03b1\u03b8\u03b5\u03c9\u03c1\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c4\u03bf \u03c3\u03c7\u03ad\u03b4\u03b9\u03cc \u03c3\u03bf\u03c5 \u03ae \u03bd\u03b1 \u03b1\u03b3\u03bd\u03bf\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c4\u03b1 \u03c3\u03c7\u03cc\u03bb\u03b9\u03b1 \u03ba\u03b1\u03b9 \u03bd\u03b1 \u03ba\u03c1\u03b1\u03c4\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c4\u03bf \u03c3\u03c7\u03ad\u03b4\u03b9\u03cc \u03c3\u03bf\u03c5 \u03cc\u03c0\u03c9\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9;",
    "S5S2_1": "\u03a4\u03ce\u03c1\u03b1 \u03b5\u03af\u03c3\u03b1\u03b9 \u03ad\u03c4\u03bf\u03b9\u03bc\u03bf\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03b4\u03bf\u03ba\u03b9\u03bc\u03ae \u03c3\u03c4\u03bf\u03bd \u03c0\u03c1\u03b1\u03b3\u03bc\u03b1\u03c4\u03b9\u03ba\u03cc \u03ba\u03cc\u03c3\u03bc\u03bf. \u0395\u03af\u03c3\u03b1\u03b9 \u03ad\u03c4\u03bf\u03b9\u03bc\u03bf\u03c2 \u03bd\u03b1 \u03b4\u03b5\u03b9\u03c2 \u03b1\u03bd \u03b7 \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ac \u03ba\u03b1\u03bb\u03ae \u03c4\u03ce\u03c1\u03b1; \u0392\u03b3\u03ac\u03b6\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03ad\u03be\u03c9 \u03ba\u03b1\u03b9 \u03c3\u03c5\u03bd\u03b1\u03bd\u03c4\u03ac\u03c2 \u03ba\u03b1\u03b9 \u03c3\u03c4\u03b1\u03bc\u03b1\u03c4\u03ac\u03c2 \u03c3\u03b5 \u03bc\u03af\u03b1 \u03b4\u03b9\u03b1\u03c3\u03c4\u03b1\u03cd\u03c1\u03c9\u03c3\u03b7. \u03a5\u03c0\u03ac\u03c1\u03c7\u03bf\u03c5\u03bd 3 \u03bc\u03bf\u03bd\u03bf\u03c0\u03ac\u03c4\u03b9\u03b1 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03b5\u03c0\u03b9\u03bb\u03ad\u03be\u03b5\u03b9\u03c2. \u0395\u03c0\u03ad\u03bb\u03b5\u03be\u03b5 \u03ad\u03bd\u03b1 \u03b1\u03c0\u03cc \u03c4\u03b1 3 \u03bc\u03bf\u03bd\u03bf\u03c0\u03ac\u03c4\u03b9\u03b1",
    "S5S2_2A": "\u039c\u03cc\u03bb\u03b9\u03c2 \u03ad\u03c6\u03c4\u03b1\u03c3\u03b5\u03c2 \u03c3\u03c4\u03b7\u03bd \u03c0\u03cc\u03bb\u03b7 \u03bc\u03b5 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03ba\u03b1\u03b9 \u03ba\u03b1\u03bd\u03ad\u03bd\u03b1\u03c2 \u03b4\u03b5\u03bd \u03c0\u03c1\u03cc\u03c3\u03b5\u03be\u03b5 \u03c4\u03b7\u03bd \u03ac\u03c6\u03b9\u03be\u03ae \u03c3\u03bf\u03c5\u2026 \u0391\u03c5\u03c4\u03cc \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ba\u03b1\u03bb\u03cc \u03c3\u03b7\u03bc\u03ac\u03b4\u03b9. \u0397 \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03ae \u0386\u03bc\u03b1\u03be\u03b1 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c4\u03c1\u03b1\u03b2\u03ac\u03b5\u03b9 \u03c4\u03b7\u03bd \u03c0\u03c1\u03bf\u03c3\u03bf\u03c7\u03ae \u03cc\u03bb\u03c9\u03bd! \u039f \u03ba\u03cc\u03c3\u03bc\u03bf\u03c2 \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c3\u03c5\u03b3\u03ba\u03b5\u03bd\u03c4\u03ce\u03bd\u03b5\u03c4\u03b1\u03b9 \u03b3\u03cd\u03c1\u03c9 \u03b1\u03c0\u03cc \u03b1\u03c5\u03c4\u03ae\u03bd! \u0398\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03be\u03b5\u03c4\u03ac\u03c3\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03c0\u03b5\u03c1\u03af\u03c0\u03c4\u03c9\u03c3\u03b7 \u03bd\u03b1 \u03c4\u03b7\u03bd \u03ba\u03ac\u03bd\u03b5\u03b9\u03c2 \u03c0\u03b9\u03bf \u03b1\u03be\u03b9\u03bf\u03c0\u03c1\u03cc\u03c3\u03b5\u03ba\u03c4\u03b7!",
    "S5S2_2": "\u0395\u03c7\u03b5\u03b9\u03c2 \u03b5\u03c0\u03b9\u03bb\u03ad\u03be\u03b5\u03b9 \u03bd\u03b1 \u03c0\u03b5\u03c1\u03b9\u03b2\u03ac\u03bb\u03bb\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03bc\u03b5 \u03b4\u03b9\u03b1\u03c3\u03ba\u03b5\u03b4\u03b1\u03c3\u03c4\u03ad\u03c2 (\u03bc\u03bf\u03c5\u03c3\u03b9\u03ba\u03bf\u03cd\u03c2, \u03ba\u03b1\u03bb\u03bb\u03b9\u03c4\u03ad\u03c7\u03bd\u03b5\u03c2), \u03c3\u03b7\u03bc\u03b1\u03af\u03b5\u03c2 \u03ba\u03b1\u03b9 \u03c6\u03b1\u03bd\u03c4\u03b1\u03c7\u03c4\u03b5\u03c1\u03ac \u03b6\u03ce\u03b1 \u03b5\u03bb\u03ad\u03c6\u03b1\u03bd\u03c4\u03b5\u03c2\/\u03b6\u03ad\u03b2\u03c1\u03b5\u03c2\/\u03ba\u03b1\u03bc\u03ae\u03bb\u03b5\u03c2\/\u03c3\u03c4\u03c1\u03bf\u03c5\u03b8\u03bf\u03ba\u03ac\u03bc\u03b7\u03bb\u03bf\u03c5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c0\u03ac\u03c2 \u03c3\u03c4\u03bf \u03c3\u03c5\u03bd\u03ad\u03b4\u03c1\u03b9\u03bf \u03c4\u03c9\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03b4\u03c9\u03bd \u03ba\u03b1\u03b9 \u03c4\u03c9\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03c3\u03c3\u03ce\u03bd! \u0391\u03c5\u03c4\u03cc \u03c0\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03ba\u03b1\u03bb\u03cc, \u03b5\u03af\u03bd\u03b1\u03b9 \u03cc\u03c4\u03b9 \u03b4\u03b5\u03bd \u03ad\u03c7\u03b5\u03b9 \u03b1\u03bd\u03c4\u03af\u03ba\u03c4\u03c5\u03c0\u03bf \u03c3\u03c4\u03bf \u03c3\u03c7\u03ad\u03b4\u03b9\u03bf \u03c4\u03b7\u03c2 \u03ac\u03bc\u03b1\u03be\u03b1\u03c2 \u03c3\u03bf\u03c5 \u03b1\u03bb\u03bb\u03ac \u03c3\u03bf\u03c5 \u03b5\u03c0\u03b9\u03c4\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b1\u03bd\u03c4\u03b1\u03c0\u03bf\u03ba\u03c1\u03b9\u03b8\u03b5\u03af\u03c2 \u03c0\u03c1\u03bf\u03c3\u03c9\u03c1\u03b9\u03bd\u03ac \u03c3\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03b5\u03be\u03b1\u03b9\u03c1\u03b5\u03c4\u03b9\u03ba\u03ae \u03b1\u03bd\u03ac\u03b3\u03ba\u03b7 \u03c4\u03b7\u03c2 \u03c0\u03b1\u03c1\u03bf\u03c5\u03c3\u03af\u03b1\u03c3\u03b7\u03c2. \u039c\u03c0\u03c1\u03ac\u03b2\u03bf!",
    "S5S2_3A": "\u039c\u03cc\u03bb\u03b9\u03c2 \u03ad\u03c6\u03c4\u03b1\u03c3\u03b5\u03c2 \u03c3\u03c4\u03b7\u03bd \u03c0\u03cc\u03bb\u03b7 \u03c4\u03bf\u03c5 \u03c0\u03b1\u03bb\u03b9\u03bf\u03cd \u03c3\u03bf\u03c5 \u03c6\u03af\u03bb\u03bf\u03c5, \u0386\u03c1\u03c7\u03bf\u03bd\u03c4\u03b1 \u039a\u03c1\u03b9\u03c3\u03c4\u03cc\u03c6. \u03a4\u03b9 \u03c3\u03cd\u03bc\u03c0\u03c4\u03c9\u03c3\u03b7! \u039a\u03b1\u03b9 \u03bf\u03b9 \u03b4\u03cd\u03bf \u03c3\u03c7\u03b5\u03b4\u03b9\u03ac\u03b6\u03b5\u03c4\u03b5 \u03bd\u03b1 \u03c4\u03b1\u03be\u03b9\u03b4\u03ad\u03c8\u03b5\u03c4\u03b5 \u03c3\u03c4\u03b7\u03bd \u03a0\u03bf\u03c1\u03c4\u03b1\u03bb\u03cc\u03bd\u03b1 \u03c4\u03b7\u03bd \u03b5\u03c0\u03cc\u03bc\u03b5\u03bd\u03b7 \u03bc\u03ad\u03c1\u03b1. \u03a0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c3\u03ba\u03b5\u03c6\u03c4\u03b5\u03af\u03c4\u03b5 \u03bd\u03b1 \u03bc\u03bf\u03b9\u03c1\u03b1\u03c3\u03c4\u03b5\u03af\u03c4\u03b5 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1\u2026",
    "S5S2_3": "\u03a4\u03ce\u03c1\u03b1 \u03b5\u03c0\u03ad\u03bb\u03b5\u03be\u03b5\u03c2 \u03bd\u03b1 \u03c3\u03c7\u03b5\u03b4\u03b9\u03ac\u03c3\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03b3\u03b9\u03b1 \u03ba\u03bf\u03b9\u03bd\u03ae \u03c7\u03c1\u03ae\u03c3\u03b7! \u03a3\u03c5\u03b3\u03c7\u03b1\u03c1\u03b7\u03c4\u03ae\u03c1\u03b9\u03b1! \u039f\u03b9 \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b5\u03c2 \u03ac\u03bc\u03b1\u03be\u03b5\u03c2 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c3\u03c4\u03b1\u03b8\u03bc\u03b5\u03c5\u03bc\u03ad\u03bd\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03bf 80% \u03c4\u03bf\u03c5 \u03c7\u03c1\u03cc\u03bd\u03bf\u03c5 \u03c4\u03bf\u03c5\u03c2,",
    "S5S2_4A": "\u039c\u03cc\u03bb\u03b9\u03c2 \u03c0\u03b5\u03c1\u03ac\u03c3\u03b1\u03c4\u03b5 \u03c4\u03b7\u03bd \u03b3\u03ad\u03c6\u03c5\u03c1\u03b1 \u03c4\u03b7\u03c2 \u038c\u03c3\u03bb\u03b9\u03bd\u03b1\u2026 \u0395\u03bd\u03ad\u03b4\u03c1\u03b1! \u039c\u03b9\u03b1 \u03c3\u03c5\u03bc\u03bc\u03bf\u03c1\u03af\u03b1 \u03bb\u03b7\u03c3\u03c4\u03ce\u03bd! \u0396\u03ae\u03c4\u03c9! \u039a\u03b1\u03c4\u03ac\u03c6\u03b5\u03c1\u03b5\u03c2 \u03bd\u03b1 \u03be\u03b5\u03c6\u03cd\u03b3\u03b5\u03b9\u03c2! \u03a0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b5\u03be\u03b5\u03c4\u03ac\u03c3\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03c0\u03c1\u03bf\u03c3\u03c4\u03b1\u03c3\u03af\u03b1 \u03c4\u03b7\u03c2 \u03ac\u03bc\u03b1\u03be\u03b1\u03c2\u2026",
    "S5S2_4": "\u0388\u03c7\u03b5\u03b9\u03c2 \u03b5\u03c0\u03b9\u03bb\u03ad\u03be\u03b5\u03b9 \u03bd\u03b1 \u03c0\u03b5\u03c1\u03b9\u03b2\u03ac\u03bb\u03bb\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5 \u03bc\u03b5 \u03c3\u03c4\u03c1\u03b1\u03c4\u03b9\u03ce\u03c4\u03b5\u03c2 \u03ba\u03b1\u03b9 \u03cc\u03c0\u03bb\u03b1 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c0\u03b5\u03c1\u03ac\u03c3\u03b5\u03c4\u03b5 \u03c4\u03bf\u03bd \u03ba\u03b1\u03b9\u03c1\u03cc \u03c4\u03bf\u03c5 \u03c0\u03bf\u03bb\u03ad\u03bc\u03bf\u03c5! \u0391\u03c5\u03c4\u03cc \u03c0\u03bf\u03c5 \u03b5\u03af\u03bd\u03b1\u03b9 \u03ba\u03b1\u03bb\u03cc \u03b5\u03af\u03bd\u03b1\u03b9 \u03cc\u03c4\u03b9 \u03b4\u03b5\u03bd \u03ad\u03c7\u03b5\u03b9\u03c2 \u03bd\u03b1 \u03b1\u03bb\u03bb\u03ac\u03be\u03b5\u03b9\u03c2 \u03c4\u03af\u03c0\u03bf\u03c4\u03b1 \u03c3\u03c7\u03b5\u03c4\u03b9\u03ba\u03ac \u03bc\u03b5 \u03c4\u03bf \u03c3\u03c7\u03ad\u03b4\u03b9\u03bf \u03c4\u03b7\u03c2 \u03ac\u03bc\u03b1\u03be\u03ac\u03c2 \u03c3\u03bf\u03c5. \u0391\u03c5\u03c4\u03cc \u03c3\u03bf\u03c5 \u03b5\u03c0\u03b9\u03c4\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b1\u03bd\u03c4\u03b1\u03c0\u03bf\u03ba\u03c1\u03b9\u03b8\u03b5\u03af\u03c2 \u03c0\u03c1\u03bf\u03c3\u03c9\u03c1\u03b9\u03bd\u03ac \u03c3\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7\u03bd \u03b5\u03be\u03b1\u03b9\u03c1\u03b5\u03c4\u03b9\u03ba\u03ae \u03b1\u03bd\u03ac\u03b3\u03ba\u03b7 \u03bc\u03b5 \u03bb\u03af\u03b3\u03b7 \u03c0\u03c1\u03bf\u03c3\u03c0\u03ac\u03b8\u03b5\u03b9\u03b1. \u039c\u03c0\u03c1\u03ac\u03b2\u03bf!",
    "S5S2B": "\u039d\u03ad\u03b5\u03c2 \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ad\u03c2 \u03bc\u03cc\u03bb\u03b9\u03c2 \u03b5\u03c6\u03b1\u03bd\u03af\u03c3\u03c4\u03b7\u03ba\u03b1\u03bd \u03c3\u03c4\u03bf \u03b5\u03c1\u03b3\u03b1\u03c3\u03c4\u03ae\u03c1\u03b9\u03cc \u03c3\u03bf\u03c5, \u03c0\u03ae\u03b3\u03b1\u03b9\u03bd\u03b5 \u03c0\u03af\u03c3\u03c9 \u03c3\u03b5 \u03b1\u03c5\u03c4\u03cc \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c4\u03b9\u03c2 \u03b1\u03bd\u03b1\u03ba\u03b1\u03bb\u03cd\u03c8\u03b5\u03b9\u03c2.",
    "S5S2C": "\u03a4\u03ce\u03c1\u03b1 \u03c0\u03bf\u03c5 \u03ad\u03c7\u03b5\u03b9\u03c2 \u03b1\u03bd\u03b1\u03b2\u03b1\u03b8\u03bc\u03af\u03c3\u03b5\u03b9 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1, \u03c0\u03ac\u03c1\u03b5 \u03c4\u03b7\u03bd \u03b3\u03b9\u03b1 \u03bc\u03b9\u03b1 \u03bd\u03ad\u03b1 \u03b4\u03bf\u03ba\u03b9\u03bc\u03ae.",
    "S6S1_1": "\u0395\u03af\u03bd\u03b1\u03b9 \u03b7 \u03bc\u03ad\u03c1\u03b1 \u03c0\u03bf\u03c5 \u03c0\u03b5\u03c1\u03b9\u03bc\u03ad\u03bd\u03b1\u03bc\u03b5! \u0395\u03af\u03bd\u03b1\u03b9 \u03b7 \u03ce\u03c1\u03b1 \u03bd\u03b1 \u03c0\u03b1\u03c1\u03bf\u03c5\u03c3\u03b9\u03ac\u03c3\u03bf\u03c5\u03bc\u03b5 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03ac \u03bc\u03b1\u03c2 \u03c3\u03c4\u03bf\u03bd \u0392\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03ba\u03b1\u03b9 \u03c4\u03b7\u03bd \u0392\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03b1.",
    "S6S1_2": "\u039c\u03c0\u03c1\u03ac\u03b2\u03bf! \u0388\u03c7\u03b5\u03b9\u03c2 \u03ba\u03ac\u03bd\u03b5\u03b9 \u03c6\u03b1\u03bd\u03c4\u03b1\u03c3\u03c4\u03b9\u03ba\u03ae \u03b4\u03bf\u03c5\u03bb\u03b5\u03b9\u03ac. \u0395\u03af\u03bc\u03b1\u03b9 \u03c0\u03bf\u03bb\u03cd \u03c7\u03b1\u03c1\u03bf\u03cd\u03bc\u03b5\u03bd\u03bf\u03c2 \u03bc\u03b5 \u03b1\u03c5\u03c4\u03cc.",
    "S6S1_3": "\u039d\u03b1\u03b9! \u0391\u03c5\u03c4\u03ae \u03b7 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c4\u03ad\u03bb\u03b5\u03b9\u03b1!",
    "S6S2_1": "\u03a3\u03b5 \u03b5\u03c5\u03c7\u03b1\u03c1\u03b9\u03c3\u03c4\u03ce \u03c0\u03bf\u03bb\u03cd \u03b1\u03bb\u03bb\u03ac \u03bc\u03ae\u03c0\u03c9\u03c2 \u03b8\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b5\u03c2 \u03bd\u03b1 \u03c4\u03b7\u03bd \u03ba\u03ac\u03bd\u03b5\u03b9\u03c2 \u03c1\u03bf\u03b6;",
    "S6S2_2": "\u039c\u03bf\u03c5 \u03b1\u03c1\u03ad\u03c3\u03b5\u03b9 \u03b1\u03bb\u03bb\u03ac \u03b8\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b5\u03c2 \u03bd\u03b1 \u03c4\u03b7\u03bd \u03ba\u03ac\u03bd\u03b5\u03b9\u03c2 \u03c3\u03c4\u03b1 \u03c7\u03c1\u03ce\u03bc\u03b1\u03c4\u03b1 \u03c4\u03bf\u03c5 \u03bf\u03c5\u03c1\u03ac\u03bd\u03b9\u03bf\u03c5 \u03c4\u03cc\u03be\u03bf\u03c5;",
    "S6S2_3": "\u0395\u03af\u03bd\u03b1\u03b9 \u03bc\u03b9\u03b1 \u03c6\u03b1\u03bd\u03c4\u03b1\u03c3\u03c4\u03b9\u03ba\u03ae \u03ac\u03bc\u03b1\u03be\u03b1 \u03b1\u03bb\u03bb\u03ac \u03b8\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b5\u03c2 \u03bd\u03b1 \u03c4\u03b7\u03c2 \u03b2\u03ac\u03bb\u03b5\u03b9\u03c2 \u03c6\u03c4\u03b5\u03c1\u03ac;",
    "S6S2_4": "\u039c\u03bf\u03c5 \u03b1\u03c1\u03ad\u03c3\u03b5\u03b9 \u03b1\u03bb\u03bb\u03ac \u03b8\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b5\u03c2 \u03bd\u03b1 \u03c4\u03b7\u03bd \u03ba\u03b1\u03bb\u03cd\u03c8\u03b5\u03b9\u03c2 \u03bc\u03b5 \u03c0\u03bf\u03cd\u03c0\u03bf\u03c5\u03bb\u03b1;",
    "S6S3_1": "\u03a6\u03af\u03bb\u03b5 \u03bc\u03bf\u03c5, \u03ad\u03c7\u03b5\u03b9\u03c2 \u03ba\u03ac\u03bd\u03b5\u03b9 \u03bc\u03b9\u03b1 \u03b1\u03c0\u03af\u03c3\u03c4\u03b5\u03c5\u03c4\u03b7 \u03b4\u03bf\u03c5\u03bb\u03b5\u03b9\u03ac! \u0391\u03c5\u03c4\u03cc \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c1\u03b9\u03c3\u03c4\u03bf\u03cd\u03c1\u03b3\u03b7\u03bc\u03b1! \u039c\u03c0\u03bf\u03c1\u03b5\u03af\u03c2 \u03bd\u03b1 \u03b5\u03af\u03c3\u03b1\u03b9 \u03c0\u03b5\u03c1\u03ae\u03c6\u03b1\u03bd\u03bf\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03bf\u03bd \u03b5\u03b1\u03c5\u03c4\u03cc \u03c3\u03bf\u03c5. \u038c\u03bb\u03bf \u03c4\u03bf \u03b2\u03b1\u03c3\u03af\u03bb\u03b5\u03b9\u03bf \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03c5\u03b3\u03bd\u03ce\u03bc\u03c9\u03bd. \u0394\u03b5\u03bd \u03be\u03ad\u03c1\u03c9 \u03c0\u03bf\u03b9\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03c4\u03b1 \u03c3\u03c7\u03ad\u03b4\u03b9\u03ac \u03c3\u03bf\u03c5 \u03b3\u03b9\u03b1 \u03c4\u03bf \u03bc\u03ad\u03bb\u03bb\u03bf\u03bd, \u03b1\u03bb\u03bb\u03ac \u03bc\u03b7\u03bd \u03c7\u03ac\u03c3\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03b9\u03ba\u03cc\u03c4\u03b7\u03c4\u03ac \u03c3\u03bf\u03c5!",
    "B1": "\u00ab\u0394\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03b9\u03ba\u03cc \u039c\u03c5\u03b1\u03bb\u03cc\u00bb",
    "B2": "\u00ab\u039a\u03c1\u03b9\u03c4\u03b9\u03ba\u03ac \u03c3\u03ba\u03b5\u03c0\u03c4\u03cc\u03bc\u03b5\u03bd\u03bf\u03c2\u00bb",
    "B3": "\u00ab\u0391\u03ba\u03c1\u03bf\u03b1\u03c4\u03ae\u03c2\u00bb",
    "B4": "\u00ab\u0395\u03c0\u03b9\u03bc\u03ad\u03bd\u03c9\u03bd\u00bb",
    "B5": "\u00ab\u039b\u03cd\u03c4\u03b7\u03c2 \u03c0\u03c1\u03bf\u03b2\u03bb\u03b7\u03bc\u03ac\u03c4\u03c9\u03bd\u00bb",
    "M1": "\u03a4\u03ce\u03c1\u03b1 \u03bc\u03c0\u03bf\u03c1\u03b5\u03af\u03c2 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c7\u03c9\u03c1\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c3\u03c4\u03bf \u03b5\u03c0\u03cc\u03bc\u03b5\u03bd\u03bf \u03b2\u03ae\u03bc\u03b1",
    "M2": "\u039a\u03ac\u03bd\u03b5 \u03ba\u03bb\u03b9\u03ba \u03c3\u03b5 \u03ad\u03bd\u03b1\u03bd \u03c7\u03b1\u03c1\u03b1\u03ba\u03c4\u03ae\u03c1\u03b1 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03bb\u03ac\u03b2\u03b5\u03b9\u03c2 \u03c3\u03c7\u03cc\u03bb\u03b9\u03b1",
    "M3": "\u039a\u03ac\u03bd\u03b5 \u03ba\u03bb\u03b9\u03ba \u03c3\u03b5 \u03ad\u03bd\u03b1\u03bd \u03c7\u03b1\u03c1\u03b1\u03ba\u03c4\u03ae\u03c1\u03b1 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03bb\u03ac\u03b2\u03b5\u03b9\u03c2 \u03c3\u03c7\u03cc\u03bb\u03b9\u03b1",
    "next.page": "\u0391\u03c0\u03cc\u03bc\u03b5\u03bd\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1",
    "previous.page": "\u03a0\u03c1\u03bf\u03b7\u03b3\u03bf\u03cd\u03bc\u03b5\u03bd\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1",
    "see.result": "\u0394\u03b5\u03c2 \u03c4\u03b1 \u03b1\u03c0\u03bf\u03c4\u03b5\u03bb\u03ad\u03c3\u03bc\u03b1\u03c4\u03b1",
    "next.step": "\u0395\u03c0\u03cc\u03bc\u03b5\u03bd\u03bf \u03b2\u03ae\u03bc\u03b1",
    "start": "\u0391\u03c1\u03c7\u03ae",
    "B6": "\u039a\u03bb\u03b5\u03af\u03c3\u03b9\u03bc\u03bf",
    "B7": "\u03a3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03bf",
    "B8": "\u03a0\u03ae\u03b3\u03b1\u03b9\u03bd\u03b5 \u03c3\u03c4\u03bf \u03b5\u03c1\u03b3\u03b1\u03c3\u03c4\u03ae\u03c1\u03b9\u03bf",
    "B9": "\u0393\u03c1\u03ac\u03c8\u03b5 \u03c4\u03bf \u03cc\u03bd\u03bf\u03bc\u03ac \u03c3\u03bf\u03c5...",
    "B10": "\u0395\u03ba\u03ba\u03af\u03bd\u03b7\u03c3\u03b7 \u03bd\u03ad\u03bf\u03c5 \u03c0\u03b1\u03b9\u03c7\u03bd\u03b9\u03b4\u03b9\u03bf\u03cd",
    "B11": "\u03a6\u03cc\u03c1\u03c4\u03c9\u03c3\u03b7 \u03c0\u03c1\u03bf\u03b7\u03b3\u03bf\u03cd\u03bc\u03b5\u03bd\u03bf \u03c0\u03b1\u03b9\u03c7\u03bd\u03b9\u03b4\u03b9\u03bf\u03cd",
    "S4L1": "\u03c1\u03cc\u03b4\u03b5\u03c2",
    "S4L2": "\u03c3\u03b1\u03c3\u03af",
    "S4L3": "\u03b8\u03ad\u03c3\u03b7 \u03bf\u03b4\u03b7\u03b3\u03bf\u03cd",
    "S4L4": "\u03b5\u03c3\u03c9\u03c4\u03b5\u03c1\u03b9\u03ba\u03ad\u03c2 \u03b8\u03ad\u03c3\u03b5\u03b9\u03c2",
    "S4L5": "\u03c4\u03bf\u03af\u03c7\u03bf\u03b9",
    "S4L6": "\u03b1\u03c0\u03bf\u03b8\u03b7\u03ba\u03b5\u03c5\u03c4\u03b9\u03ba\u03cc\u03c2 \u03c7\u03ce\u03c1\u03bf\u03c2",
    "N1L1": "\u039a\u03b1\u03c4\u03b1\u03c3\u03ba\u03b5\u03cd\u03b1\u03c3\u03b5 \u03c4\u03b7\u03bd \u03ba\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b7, \u03c4\u03b7\u03bd \u03c0\u03b9\u03bf \u03c0\u03c1\u03b1\u03ba\u03c4\u03b9\u03ba\u03ae \u03ba\u03b1\u03b9 \u03c0\u03b9\u03bf \u03cc\u03bc\u03bf\u03c1\u03c6\u03b7 \u03ac\u03bc\u03b1\u03be\u03b1 \u03b3\u03b9\u03b1 \u03c4\u03b7 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ba\u03ae \u03bf\u03b9\u03ba\u03bf\u03b3\u03ad\u03bd\u03b5\u03b9\u03b1",
    "N1L2": "\u03a7\u03b1\u03c1\u03b1\u03ba\u03c4\u03ae\u03c1\u03b5\u03c2",
    "N1L3": "\u0394\u03b5\u03af\u03ba\u03c4\u03b5\u03c2",
    "N1L4": "\u0386\u03bc\u03b1\u03be\u03b5\u03c2",
    "N1L5": "\u03a0\u03b1\u03c1\u03b1\u03b4\u03b5\u03af\u03b3\u03bc\u03b1\u03c4\u03b1",
    "N1L6": "\u0397 \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03bf\u03c5",
    "N1L7": "\u0394\u03b9\u03b1\u03c4\u03b1\u03c1\u03b1\u03c7\u03ad\u03c2",
    "N1L8": "\u0395\u03bc\u03b2\u03bb\u03ae\u03bc\u03b1\u03c4\u03b1",
    "N1L9": "\u0397 \u03b1\u03c0\u03bf\u03c3\u03c4\u03bf\u03bb\u03ae",
    "S6A1": "\u03a3\u03b5 \u03b5\u03c5\u03c7\u03b1\u03c1\u03b9\u03c3\u03c4\u03ce, \u03b2\u03b1\u03c3\u03af\u03bb\u03b9\u03c3\u03c3\u03ac \u03bc\u03bf\u03c5! \u039c\u03bf\u03c5 \u03ac\u03c1\u03b5\u03c3\u03b5 \u03c0\u03c1\u03b1\u03b3\u03bc\u03b1\u03c4\u03b9\u03ba\u03ac \u03c0\u03bf\u03c5 \u03b4\u03bf\u03cd\u03bb\u03b5\u03c8\u03b1 \u03c0\u03ac\u03bd\u03c9 \u03c3\u03b5 \u03b1\u03c5\u03c4\u03cc! \u039a\u03b1\u03b9 \u03b5\u03af\u03c7\u03b1 \u03ba\u03b1\u03b9 \u03c0\u03bf\u03bb\u03bb\u03ad\u03c2 \u03ac\u03bb\u03bb\u03b5\u03c2 \u03b9\u03b4\u03ad\u03b5\u03c2 \u03c0\u03c1\u03bf\u03c3\u03c0\u03b1\u03b8\u03ce\u03bd\u03c4\u03b1\u03c2 \u03bd\u03b1 \u03c3\u03c7\u03b5\u03b4\u03b9\u03ac\u03c3\u03c9 \u03c4\u03b7\u03bd \u03ba\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b7 \u03ac\u03bc\u03b1\u03be\u03b1, \u03af\u03c3\u03c9\u03c2 \u03bc\u03b5\u03c1\u03b9\u03ba\u03ad\u03c2 \u03b8\u03b1 \u03ae\u03c4\u03b1\u03bd \u03c7\u03c1\u03ae\u03c3\u03b9\u03bc\u03b5\u03c2 \u03c3\u03b5 \u03b5\u03c3\u03ac\u03c2;",
    "S6A2": "\u03a3\u03c5\u03bd\u03ad\u03c7\u03b9\u03c3\u03b5!",
    "S6A3": "\u039b\u03bf\u03b9\u03c0\u03cc\u03bd, \u03af\u03c3\u03c9\u03c2 \u03b8\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b5\u03c2 \u03bd\u03b1 \u03ba\u03ac\u03bd\u03b5\u03b9\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03c0\u03b9\u03bf\u2026",
    "S6A4": "\u038c\u03bc\u03bf\u03c1\u03c6\u03b7, \u03c0\u03b5\u03c1\u03b9\u03c3\u03c4\u03bf\u03b9\u03c7\u03af\u03b6\u03bf\u03bd\u03c4\u03b1\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03bc\u03b5 \u03b4\u03b9\u03b1\u03c3\u03ba\u03b5\u03b4\u03b1\u03c3\u03c4\u03ad\u03c2 (\u03bc\u03bf\u03c5\u03c3\u03b9\u03ba\u03bf\u03cd\u03c2, \u03ba\u03b1\u03bb\u03bb\u03b9\u03c4\u03ad\u03c7\u03bd\u03b5\u03c2), \u03c3\u03b7\u03bc\u03b1\u03af\u03b5\u03c2 \u03ba\u03b1\u03b9 \u03c6\u03b1\u03bd\u03c4\u03b1\u03c7\u03c4\u03b5\u03c1\u03ac \u03b6\u03ce\u03b1 \u03cc\u03c0\u03c9\u03c2 \u03b5\u03bb\u03ad\u03c6\u03b1\u03bd\u03c4\u03b5\u03c2\/\u03ba\u03b1\u03bc\u03b7\u03bb\u03bf\u03c0\u03b1\u03c1\u03b4\u03ac\u03bb\u03b5\u03b9\u03c2\/\u03ba\u03b1\u03bc\u03ae\u03bb\u03b5\u03c2\/\u03c3\u03c4\u03c1\u03bf\u03c5\u03b8\u03bf\u03ba\u03b1\u03bc\u03ae\u03bb\u03bf\u03c5\u03c2, \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c0\u03ac\u03c4\u03b5 \u03c3\u03c4\u03bf \u03c3\u03c5\u03bd\u03ad\u03b4\u03c1\u03b9\u03bf \u03c4\u03c9\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac\u03b4\u03c9\u03bd \u03ba\u03b1\u03b9 \u03c4\u03c9\u03bd \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03c3\u03c3\u03ce\u03bd! \u03a3\u03af\u03b3\u03bf\u03c5\u03c1\u03b1 \u03cc\u03bb\u03bf\u03b9 \u03b8\u03b1 \u03b5\u03bd\u03c4\u03c5\u03c0\u03c9\u03c3\u03b9\u03b1\u03c3\u03c4\u03bf\u03cd\u03bd!",
    "S6A5": "\u03a6\u03b9\u03bb\u03b9\u03ba\u03ae \u03c0\u03c1\u03bf\u03c2 \u03c4\u03bf \u03c0\u03b5\u03c1\u03b9\u03b2\u03ac\u03bb\u03bb\u03bf\u03bd, \u03c3\u03c7\u03b5\u03b4\u03b9\u03ac\u03b6\u03bf\u03bd\u03c4\u03b1\u03c2 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1 \u03b3\u03b9\u03b1 \u03ba\u03bf\u03b9\u03bd\u03ae \u03c7\u03c1\u03ae\u03c3\u03b7! \u039f\u03b9 \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b5\u03c2 \u03ac\u03bc\u03b1\u03be\u03b5\u03c2 \u03c0\u03b1\u03c1\u03b1\u03bc\u03ad\u03bd\u03bf\u03c5\u03bd \u03c3\u03c4\u03b1\u03b8\u03bc\u03b5\u03c5\u03bc\u03ad\u03bd\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03bf 80% \u03c4\u03bf\u03c5 \u03c7\u03c1\u03cc\u03bd\u03bf\u03c5 \u03c4\u03bf\u03c5\u03c2. \u039c\u03bf\u03b9\u03c1\u03b1\u03c3\u03c4\u03b5\u03af\u03c4\u03b5 \u03c4\u03b7\u03bd!",
    "S6A6": "\u0388\u03c7\u03b5\u03b9\u03c2 \u03ba\u03ac\u03c0\u03bf\u03b9\u03b1 \u03c0\u03c1\u03cc\u03c4\u03b1\u03c3\u03b7 \u03b3\u03b9\u03b1 \u03b5\u03bc\u03ad\u03bd\u03b1;",
    "S6A7": "\u039d\u03b1\u03b9 \u03b2\u03b1\u03c3\u03b9\u03bb\u03b9\u03ac \u03bc\u03bf\u03c5. \u038a\u03c3\u03c9\u03c2 \u03b8\u03b1 \u03bc\u03c0\u03bf\u03c1\u03bf\u03cd\u03c3\u03b1\u03c4\u03b5 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c3\u03c4\u03b1\u03c4\u03ad\u03c8\u03b5\u03c4\u03b5 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03b1\u03c2 \u03c0\u03c1\u03bf\u03c3\u03b1\u03c1\u03bc\u03cc\u03b6\u03bf\u03bd\u03c4\u03ac\u03c2 \u03c4\u03b7\u03bd \u03b3\u03b9\u03b1 \u03c0\u03b5\u03c1\u03af\u03c0\u03c4\u03c9\u03c3\u03b7 \u03c0\u03bf\u03bb\u03ad\u03bc\u03bf\u03c5. \u03a4\u03b1 \u03c0\u03b9\u03bf \u03c0\u03b1\u03c7\u03b9\u03ac \u03c4\u03bf\u03b9\u03c7\u03ce\u03bc\u03b1\u03c4\u03b1 \u03b4\u03b5\u03bd \u03b8\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ac, \u03b8\u03b1 \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03c0\u03b5\u03c1\u03b9\u03b2\u03ac\u03bb\u03bb\u03b5\u03c4\u03b5 \u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03ac \u03c3\u03b1\u03c2 \u03bc\u03b5 \u03c3\u03c4\u03c1\u03b1\u03c4\u03b9\u03ce\u03c4\u03b5\u03c2 \u03ba\u03b1\u03b9 \u03b1\u03c3\u03c0\u03af\u03b4\u03b5\u03c2\/\u03b4\u03cc\u03c1\u03b1\u03c4\u03b1 \u03c0\u03ac\u03bd\u03c9 \u03c3\u03c4\u03b7\u03bd \u03ac\u03bc\u03b1\u03be\u03b1. \u03a3\u03af\u03b3\u03bf\u03c5\u03c1\u03b1 \u03b8\u03b1 \u03b5\u03bd\u03c4\u03c5\u03c0\u03c9\u03c3\u03b9\u03ac\u03c3\u03b5\u03c4\u03b5 \u03c4\u03bf\u03c5\u03c2 \u03c0\u03b9\u03b8\u03b1\u03bd\u03bf\u03cd\u03c2 \u03c3\u03b1\u03c2 \u03b5\u03c0\u03b9\u03c4\u03b9\u03b8\u03ad\u03bc\u03b5\u03bd\u03bf\u03c5\u03c2!"

}